INSERT INTO `ex_category` (`wcid`, `wcorder`, `wcname`, `wcbrief`) VALUES
(1, 1, '油畫', '油畫的介紹'),
(2, 2, '膠彩', '膠彩的介紹'),
(4, 3, '水彩', '水彩的介紹');
INSERT INTO `ex_episodes` (`epid`, `epseason`, `epnum`, `eptitle`, `epintro`, `epimg`) VALUES
(1, 1, 1, 'Yankee White', 'While on Air Force One, a Navy commanding officer dies.  Agents from the Navy NCIS decide to take the investigation into their own hands and also force a Secret Service Agent to help.  Now the NCIS team has to figure out if the Navy Officer\'s death was of natural causes or not.', 'https://image.tmdb.org/t/p/original/1nQMJ5o9X3gSTXLtF6azUtXMQ3U.jpg'),
(2, 1, 2, 'Hung Out to Dry', 'During a training exercise, a marine\'s parachute fails to open and he crashes into a parked car where two teenagers were making out.  The NCIS team heads to the scene and has to determine if the marine\'s death was accidental or a murder.', 'https://image.tmdb.org/t/p/original/iiL0xbw92OaJf8ZOBVkei9rDW8S.jpg'),
(3, 1, 3, 'Seadog', 'When a Navy commander\'s body washes up on shore along with the bodies of two drug runners, Gibbs refuses to believe that the sailor who was killed was dirty.', 'https://image.tmdb.org/t/p/original/Vezn6ZXas1IcxeG9wCcoHkTZy8.jpg'),
(4, 1, 4, 'The Immortals', 'The NCIS team investigates when a seaman\'s body is found at the bottom of the sea in his dress whites, with a ceremonial sword.  They discover that he was addicted to a MMORPG. Now, the team must figure out how involved he was in the game and how far he would go to get revenge on his arch enemy, another sailor.', 'https://image.tmdb.org/t/p/original/idwhICSRe5a3K8mykKZV3aKeQpg.jpg'),
(5, 1, 5, 'The Curse', 'A Navy lieutenant who was reported missing nearly ten years ago has been found by a deer hunter.  When the NCIS team arrives at the scene to investigate, they see that his remains have been mummified.  Now, they have to find out what happened to him and what happened to the one million dollars that he had on his ship.', 'https://image.tmdb.org/t/p/original/du4R9oWAHLfQXfGFebfI2ZKUkZd.jpg'),
(6, 1, 6, 'High Seas', 'An NCIS agent who used to work under Gibbs asks for the team\'s help investigating a case where sailors on an aircraft carrier are dying of a drug overdose, but have no history of any kind of drug abuse.', 'https://image.tmdb.org/t/p/original/y5Nn9AZJcypY5rtu17tcm6qM787.jpg'),
(7, 1, 7, 'Sub Rosa', 'A decomposed body is discovered in a tub of acid at a naval base and Ducky and Abby learn that the victim was a submariner.  Gibbs discovers that there have been no reports of a sub crewmember missing, so he deduces that one of the subs has an imposter on board.  With this new information, the team must find out which sub the man posing as the victim is in and what intentions he may have towards the sub.', 'https://image.tmdb.org/t/p/original/ki7xqZTkdC2zlzzomq97ur46xBn.jpg'),
(8, 1, 8, 'Minimum Security', 'The NCIS team head to Cuba to investigate a Navy translator\'s connection to smuggling at a detention center after he suddenly dies at the wheel of his car when returning to the U.S. from Guantanamo Bay.', 'https://image.tmdb.org/t/p/original/wAJhjll19qVLP9uTejZ4lUPCX8H.jpg'),
(9, 1, 9, 'Marine Down', 'After a marine widow receives a call from her dead husband, the NCIS team takes on the case and has to exhume the body to deduce whether the call was a prank or not.', 'https://image.tmdb.org/t/p/original/g2zfehFrjJjXpp36W4njJ7GhBOT.jpg'),
(10, 1, 10, 'Left for Dead', 'After being buried alive, a woman comes out of the grave with amnesia and the only thing she remembers is that there is a bomb aboard a Navy ship.  While trying to help Jane Doe recover her identity, the team finds out that not everything is what it seemed at first.', 'https://image.tmdb.org/t/p/original/pEnwTMaERa7BgUlr3ZoDUp0O3re.jpg'),
(11, 1, 11, 'Eye Spy', 'When a Navy commander, who was a technical advisor to a civilian contractor for a Navy weapon, is found dead on the beach, the NCIS team investigates the murder using satellite technology.', 'https://image.tmdb.org/t/p/original/vMWYMCkGdE3aUTg0UAYkLwv5V27.jpg'),
(12, 1, 12, 'My Other Left Foot', 'The NCIS team is called in when a severed leg bearing a marine tattoo is found in a trash bin, leading them to a small town where a murder scheme is afoot.', 'https://image.tmdb.org/t/p/original/kLW719NfwlM8RA11X14P2bSlEBS.jpg'),
(13, 1, 13, 'One Shot, One Kill', 'The team investigates when a Marine recruitment officer is found shot to death by a sniper with a grudge, who leaves a white feather behind.', 'https://image.tmdb.org/t/p/original/4yqXFjMAO2i1zG1iIeNPETrbACI.jpg'),
(14, 1, 14, 'The Good Samaritan', 'A navy dentist stops near the parked car to help a stranded motorist who pulls out a gun. The team investigates a murder with the help from a local sheriff, Charley, when they find out about a the similar murder of the Navy civilian employee in the was going through the nasty divorce,the wife is suspected but her alibi is perfect.', 'https://image.tmdb.org/t/p/original/hdysX1ucDlu7tjbbXBazVZW2hDo.jpg'),
(15, 1, 15, 'Enigma', 'Gibbs risks his career when his former commanding officer is accused of stealing the funds.', 'https://image.tmdb.org/t/p/original/9bZKlRpQ5IeZK7HxeR9HDMwvvPe.jpg'),
(16, 1, 16, 'Bête Noire', 'A terrorist holds Ducky, Gerald, and Kate hostage while NCIS investigate how exactly the terror organization member got a job at the navy base.', 'https://image.tmdb.org/t/p/original/s13tfepNcoy6c72nE79xjbuntiW.jpg'),
(17, 1, 17, 'The Truth Is Out There', 'When the body of a sailor is found after a party in an illegal night club, the team investigates a number of possible leads - including blackmail and accidental death.', 'https://image.tmdb.org/t/p/original/l17opF8lneVr5hpya6guw69cFka.jpg'),
(18, 1, 18, 'UnSEALed', 'The team is looking for an ex-SEAL who escaped from prison in search of revenge. He is determined to find the real murderer of his wife.', 'https://image.tmdb.org/t/p/original/y3fYfkx4sJbjB5rnu8uAC2Oqxhd.jpg'),
(19, 1, 19, 'Dead Man Talking', 'An NCIS agent has been murdered while investigating a case and the team\'s job is to find out what happened...', 'https://image.tmdb.org/t/p/original/jzHBb9TUZrcBmelZ7uAWstWbEgz.jpg'),
(20, 1, 20, 'Missing', 'A marine goes missing after a date with a reporter. During the investigation, the team discovers that three former members of his unit are dead and suspect the unit commander to be a serial killer.', 'https://image.tmdb.org/t/p/original/d2Pki0ftndfhsPnIyQSPAGIQ7kD.jpg'),
(21, 1, 21, 'Split Decision', 'When a body of a murdered marine is found in the forest, the investigation leads to the local militia and a weapon deal gone wrong.', 'https://image.tmdb.org/t/p/original/5YaHqerTeq7yuXm1zVJQFpdMUVT.jpg'),
(22, 1, 22, 'A Weak Link', 'Gibbs\' team investigates the death of a SEAL during a training exercise, and come to suspect that it wasn\'t an accident, but a murder.', 'https://image.tmdb.org/t/p/original/1aGgvT2sIuqf4SUpjXINHEp5DiU.jpg'),
(23, 1, 23, 'Reveille', 'The terrorist from Bette Noir returns with a plan to attack the President. Gibbs and his team follow the clues to reveal his identity and find Kate who is kidnapped.', 'https://image.tmdb.org/t/p/original/jCkNJV9B1BWHWbYQ34u2ao6I1sZ.jpg'),
(24, 2, 1, 'See No Evil', 'A wife and a 9-year-old blind daughter of a Navy captain are kidnapped and the captain is a hostage in his own office, communicating with kidnappers, who watch his every step via computer camera.  NCIS team investigates the scheme where large amount of money is involved.', 'https://image.tmdb.org/t/p/original/gjTeJvwTMswAVVl4U5TFA98gP3B.jpg'),
(25, 2, 2, 'The Good Wives Club', 'A mummified remains of a woman are found in the abandoned compound. The team discovers that the woman was missing for several months, was wearing a wedding dress when she died, and might\'ve been a victim of a serial killer. The search for the murderer leads them to Florida, where they start looking for another woman who mysteriously disappeared after going to work. One of the clues they have is the old manual for good wifes.', 'https://image.tmdb.org/t/p/original/sQwwwpSY1Ub8XQ5H88X6tpgQsIN.jpg'),
(26, 2, 3, 'Vanished', 'The NCIS team is called in to investigate when a perfectly functioning  Marine helicopter is found in the middle of a crop circle.', 'https://image.tmdb.org/t/p/original/ApdYPp0gz0VM31WaiLJEocDSbWx.jpg'),
(27, 2, 4, 'Lt. Jane Doe', 'A body of a woman in the Navy uniform is found by two sailors.  Ducky links the murder to an unsolved case from 10 years ago, and the team is searching for the serial killer who leaves the note promising to return.', 'https://image.tmdb.org/t/p/original/7CyBcg8FCg5shib7KHSthWqUBkw.jpg'),
(28, 2, 5, 'The Bone Yard', 'NCIS discovers that an area in the Marine\'s bombing range is where mafia has been dumping the bodies for a while. One of the victims is an undercover FBI agent. The team sets out to find a mole.', 'https://image.tmdb.org/t/p/original/7tDvEftJeEwt9MeumZc0vm3SWdy.jpg'),
(29, 2, 6, 'Terminal Leave', 'The team must protect an Iraq veteran due to the threats made by the terrorists. While trying to convince an FBI Agent Lina Reyes to help them, the team is convinced that they have discovered the bomber. However, more secrets are about to be revealed...', 'https://image.tmdb.org/t/p/original/so10ph6K6aRJUthkfkbXe45pcwT.jpg'),
(30, 2, 7, 'Call of Silence', 'Ernie Yost, an elder Marine veteran confesses to murdering his best friends almost 60 years ago in a war battle and the NCIS\'s job is to solve all the secrets and save Ernie from prison.', 'https://image.tmdb.org/t/p/original/8C7cRkddKHH09KTL2laSWMkyOSz.jpg'),
(31, 2, 8, 'Heart Break', 'A strange case for Gibbs and his team opens when a Navy Commendar dies after successful surgery. While researching through commander\'s past, the team finds out that he collected a lot of enemies lately and tracks down a ensign making him the prime suspect. Soon Abby realizes that they got the wrong man...', 'https://image.tmdb.org/t/p/original/lgjPo9T9vaMKpiqpk6RlMNhYMqx.jpg'),
(32, 2, 9, 'Forced Entry', 'Laura Rowen (guest star Megan Ward), a Marine\'s wife, shoots an intruder in self defense when he is about to rape her. The team takes upon the case and finds out that the wife is leading a double life while her husband is serving overseas. Allegedly, she has been chatting with a stranger on the net and had no idea about his true intentions. The team believes that she might have lured him to her home, not knowing that he is a serial rapist...', 'https://image.tmdb.org/t/p/original/xD70qaFE4TgVAJ3YmdDhpfDdoPl.jpg'),
(33, 2, 10, 'Chained', 'Tony disappears while doing an undercover operation as an escaped prisoner who is forced to stick to a convinct that owns a key to an expensive ancient Iraqi sculpture. The GPS locator that Abby planted on Tony stops working and the team is forced to find Tony before he gets murdered by the thief.', 'https://image.tmdb.org/t/p/original/3BbSjk60XEwczP5xxmMCRW8X8b1.jpg'),
(34, 2, 11, 'Black Water', 'A dead body of a 2-year-missing Navy officer appears on the bottom of a lake. The team investigates the case with a help of a private detective. Meanwhile, a famous family offers a lot of money in exchange for the information about the missing body. The team is surprised when a bullet is found in a car. Now the dissapereance becomes a murder...', 'https://image.tmdb.org/t/p/original/sW05qHzN9BlLg3dZIJmkNoS0T2D.jpg'),
(35, 2, 12, 'Doppelgänger', 'The team takes upon another strange case when a telemarketer reports a possible murder of a petty officer who appeared to be dying over the phone. However, with the help of Virginia officials, the team finds out that officer\'s call was just a big joke using the computer skills, until he is actually found dead...', 'https://image.tmdb.org/t/p/original/a0Z2fYv7gmflLmkZXyB2Epf8o1i.jpg'),
(36, 2, 13, 'The Meat Puzzle', 'A \"meat puzzle\" starts when Ducky identifies the pieces of three bodies that were stuffed inside a barrel few months ago and they turn out to be bodies of a judge, prosecutor and jury foreman that worked with Ducky on a rape case 10 years ago. Gibbs believes that Ducky might be the next victim of the killer, so he orders the team to keep him and his mother safe. Even so, Ducky is kidnapped during the investigation and now the team must find him before it\'s too late.', 'https://image.tmdb.org/t/p/original/yyIPwElKKSUweoyBuM3uJqbGndW.jpg'),
(37, 2, 14, 'Witness', 'Erin Kendall (guest star Danica McKellar) claims to have seen a murder of a sailor in an apartment across from hers. Gibbs assigns the case to McGee who believes that he can resolve it himself. However, due to the lack of physical evidence, McGee turns to the team to help him...', 'https://image.tmdb.org/t/p/original/bbfB1vwVUieWwjdQhkRfGUtdlJX.jpg'),
(38, 2, 15, 'Caught on Tape', 'The team takes on a case of a dead Marine who recorded his death while falling off a cliff. The prime suspects are his wife and his best friend with whom he had a picnic in the camp. Gibbs finds out they had an affair behind the dead man\'s back and he tries to persuade each of them to blame each other. Meanwhile, Abby reconstructs the case using her computer skills to handler the Marine\'s camera...', 'https://image.tmdb.org/t/p/original/1ZewCCBAfmkT2j5m1LI1VkRUEZK.jpg'),
(39, 2, 16, 'Pop Life', 'NCIS starts the investigation after petty officer Manda King is found dead in the bartender\'s bed. The suspect is the owner of the competing club where Manda\'s sister sings.', 'https://image.tmdb.org/t/p/original/uqGuvrr9wybB7drNyScSxqUcOzQ.jpg'),
(40, 2, 17, 'An Eye for an Eye', 'When a sailor officer receives a pair of blue eyeballs, the NCIS team starts investigating the case. Gibbs comes on a trace for a past Navy agent that does illegal work.', 'https://image.tmdb.org/t/p/original/oUbSj4HxGZF0KptgrvJ6jBYphOa.jpg'),
(41, 2, 18, 'Bikini Wax', 'A petty officer that just returned to his job is found dead in the backstage of the bikini contest. The team finds out that she possibly had a stalker behind her back...', 'https://image.tmdb.org/t/p/original/1hSf8FGTPthQvzQMg3Y6eimhP4s.jpg'),
(42, 2, 19, 'Conspiracy Theory', 'The team investigates a suicide case, believing that the main reason of her death is a nervous breakdown, but Ducky believes that she was actually murdered. FBI Special Agent Fornell helps them in the investigation. The team discovers that the dead woman was involved in a love triangle and that this may have contributed to her death.', 'https://image.tmdb.org/t/p/original/h65f50UXgdNgVVB66qvveqMztJq.jpg'),
(43, 2, 20, 'Red Cell', 'After a marine is murdered in the school campus the team discovers a possible suspect for his murder, but they are soon leaded back to zero point when they find the suspect murdered. Tim & Abby discover a trace to a \"\"Red Cell\"\" in the e-mails and the team believes that maybe the marine was involved in a serious game...', 'https://image.tmdb.org/t/p/original/7Zliz7GH1nRyHlZCUrHP9fBHPvo.jpg'),
(44, 2, 21, 'Hometown Hero', 'A young Marine is killed in Iraq, but he was investigated by police for a murder on a young girl in his hometown. While going through his personal belongings, they find the body of that girl. The local police believes that the corpsman murdered the girl, but Gibbs believes that he is innocent and he will try to prove it with a help of Faith Coleman (guest star Alicia Coppola).', 'https://image.tmdb.org/t/p/original/iNt3dUzNfeFtBdr0tDDtwKs71By.jpg'),
(45, 2, 22, 'SWAK', 'When Tony opens a mysterious letter thinking it\'s for him, a small puff of white powder comes out and it releases a possible deadly virus. Kate calls for help and soon she and Tony are isolated in a bio-hazard isolation room for precausion. McGee and Gibbs work to discover who sent the envelope and how to cure their friends before its too late for them. Meanwhile, Tony\'s health gets worse...', 'https://image.tmdb.org/t/p/original/xsTeNrXxzFMcBL3xMEtx13BaS0F.jpg'),
(46, 2, 23, 'Twilight', 'A group of serial terrorists seek revenge and send Ari (guest star Rudolf Martin) on an assignment to kill Gibbs. The NCIS team goes on a hunt after him, but when they discover that Ari has a bigger plan, it is already too late... the NCIS team will have to face the death of one of their team members...', 'https://image.tmdb.org/t/p/original/bWwesh80czKzQaKulIP3CUcy5RT.jpg'),
(47, 3, 1, 'Kill Ari (1)', 'After the terrorist\'s attack, the NCIS team is shocked and is trying to cope with Kate\'s sudden death, each in their own way. Now, their mission is to collect all the possible info on Ari and find a way to stop him before he does any more damage. Meanwhile, while feeling guilty over Kate\'s death, Gibbs is informed that the NCIS director is leaving, and the replacement is Jenny Shepard, a woman Gibbs worked with in the past and had a romantic history with.', 'https://image.tmdb.org/t/p/original/qxQUJtawHa8WJxX7IWGaDtfULh.jpg'),
(48, 3, 2, 'Kill Ari (2)', 'Still stressed over Kate\'s death, Gibbs is even more hurt when Ari kidnaps Ducky and decides to play with his mind. Gibbs sends Tony to follow Ziva, and after Jenny and Gibbs are almost shot to death, he is even more determined to finish once and for all with Ari, and Ziva\'s strange connection to Ari will be just the help that he needs.', 'https://image.tmdb.org/t/p/original/tmQ9SQpqMxlgypHh42lcc0kOunY.jpg'),
(49, 3, 3, 'Mind Games', 'Gibbs is ordered to talk to a convict that is about to be executed, in order to discover information about the place where he hid his victims, but when the plan doesn\'t work, the team must solve the case in their own way.', 'https://image.tmdb.org/t/p/original/tWC7L0IFbsjw4GCBFtGlr5bGzTq.jpg'),
(50, 3, 4, 'Silver War', 'When a corpse of a man is found inside a tomb that comes from the Civil War, the team discovers that the victim, a Sergeant, was buried alive. During the investigation, Abby tracks down the last phone call of the victim. Meanwhile, Gibbs is informed by his new boss Jenny Sheppard that agent Ziva is now a full-time NCIS agent.', 'https://image.tmdb.org/t/p/original/aOiGUS1uvUeFg9q4TLrvGZhqFvq.jpg'),
(51, 3, 5, 'Switch', 'When an officer is shot to death on the freeway, the NCIS team takes upon the investigation. The first lead, a fact that the victim was leading a double life, takes them to a possible solution of the crime, but the tables are turned when the victim\'s dying message is discovered and it leads them to a totally different clue.', 'https://image.tmdb.org/t/p/original/qGF8BqNWamAl0GIORxSBm1J9wi0.jpg'),
(52, 3, 6, 'The Voyeur\'s Web', 'The NCIS team takes upon a strange case - a Marine\'s wife was murdered live on the Internet. The investigation reveals that two housewives were running a live Internet sex site and now they are both missing. While looking for them, the team will try to track down the webmaster and solve the alleged murder case.', 'https://image.tmdb.org/t/p/original/160NliksaHZCz1uZTQo7J8tz6kM.jpg'),
(53, 3, 7, 'Honor Code', 'When a 6-year-old boy informs the NCIS team that his father was kidnapped, the team discovers that the missing father is actually a Lt. Commander working on a secret project named Honor, and that he is the only one who has the code that can open the project. While Gibbs gets closer with the boy, the rest of the team discovers that the project has been hacked in and the information inside has been deleted. Is the missing man innocent or is he actually the guilty one?', 'https://image.tmdb.org/t/p/original/fFlwrCzXqwmhoW03RCoXZr6zxyX.jpg'),
(54, 3, 8, 'Under Covers', 'When bodies of two hired assassins are delivered to the NCIS team, Ziva & Tony go undercover assuming the victim\'s identities in order to find the person who hired the assassins for their mission. While working on the case, Ziva & Tony spend some quality time in a luxury hotel and the attraction between them arises. Gibbs discovers that his team is not the only one working on the case.', 'https://image.tmdb.org/t/p/original/vjhTLx9wreWUiSRgujMJFgCEg6M.jpg'),
(55, 3, 9, 'Frame-Up', 'Tony is accused of murdering a woman whos body was found at Quantico and the team must prove his innocence. All the possible evidence prove that Tony is guilty and the team will give their best to set their agent and a friend free.', 'https://image.tmdb.org/t/p/original/eMaUBZBeaheJJZfy1XB65VAYtad.jpg'),
(56, 3, 10, 'Probie', 'While on duty, McGee kills a man who is later discovered to be an undercover police officer. When Jenny decides to approve the investigation on McGee, the NCIS team is forced to prove that McGee is not guilty, pushing Gibbs\' relationship with Jen to the limit.  Meanwhile, Tony is troubled by his past.', 'https://image.tmdb.org/t/p/original/sA98ImwEsAkjCHJWjyGVhWajDfJ.jpg'),
(57, 3, 11, 'Model Behavior', 'While filming a reality show on a Marine base, a supermodel dies and the NCIS team must discover who is the model\'s murderer. They discover a love triangle between the model and three other men, all suspects. Meanwhile, Jenny is disturbed by Gibbs when he doesn\'t want to attend an award ceremony in his honor.', 'https://image.tmdb.org/t/p/original/6STMw50xyG9h5OpXonqzEVADMLW.jpg'),
(58, 3, 12, 'Boxed In', 'While on investigation at a shipyard, looking for smuggled weapons, Tony and Ziva dissapear and it\'s up to NCIS to find them. Abby tries to track them down by tracking down their GPS chips, but they seem to be out of reach. Meanwhile, Tony and Ziva, hiding in a container, find evidence which could help them solve the case.', 'https://image.tmdb.org/t/p/original/5rcW3QUyoA0KsajwD8WETegHXfA.jpg'),
(59, 3, 13, 'Deception', 'When a Commander in charge of a shipment of fuel rods for nuclear power stations disappears, the NCIS team is called in. The team must solve the case in time, before the person who kidnapped the Commander finds out the secret location of the fuel rods or harms the Lt. Commander.', 'https://image.tmdb.org/t/p/original/jrhhfxkEX47ejuWZWyLRPg6qsJA.jpg'),
(60, 3, 14, 'Light Sleeper', 'The NCIS team investigates the murder of two Marine wives, and must find the murderers before they attack their next target, another woman.', 'https://image.tmdb.org/t/p/original/czbVM8BATl6nU6HpsvblBYJTAlN.jpg'),
(61, 3, 15, 'Head Case', 'While discovering an illegal automotive chop shop, the NCIS team stumbles upon a severed head of a Marine, hidden in one of the cars from the shop. When they find possible suspects, the team will have to find the rest of the body and find the murderer.', 'https://image.tmdb.org/t/p/original/p1wtZkik3iWHGmwlPg0uJWcDe3.jpg'),
(62, 3, 16, 'Family Secret', 'When an ambulance explodes while carrying the remains of a Marine\'s body that was killed in a car crash, the NCIS team is called in to investigate what actually happened. The investigation leads them to some sudden discoveries -- the DNA of the victim found in the ambulance doesn\'t match the Marine\'s DNA; the ambulance was set up to explode; and the family of the dead Marine is hiding a very important secret.', 'https://image.tmdb.org/t/p/original/vr0oD7OqDSaInR7wt6idXobf876.jpg'),
(63, 3, 17, 'Ravenous', 'When Marine dog tags are found in a national forest by a group of teens, the NCIS team is called in to investigate. While searching for the campsite of the Marine, the team finds out that there was another person, possibly a woman, with him. The investigation takes them to an even more higher discovery -- there could be a serial killer killing women in the national forest.', 'https://image.tmdb.org/t/p/original/wy9bP3jiCnxxDpE6dn8ILQ1LU19.jpg'),
(64, 3, 18, 'Bait', 'The NCIS team must stop a teenage student from detonating a bomb attached to his body, while he\'s taking the other students hostage at a Quantico base high school. Gibbs tries to stop him when he enters the classroom, only to realize that there may be someone else controlling the teenage student from the outside. Meanwhile, while Gibbs is in the classroom, Tony is left in charge.', 'https://image.tmdb.org/t/p/original/6llFhg9oPNLGSks57Ujst0LWd87.jpg'),
(65, 3, 19, 'Iced', 'Gibbs and the team are called in when a couple of kids stumble upon the body of a missing Marine in a frozen lake.  As the NCIS team searches the frozen lake bed for clues, they come across three more bullet-ridden bodies. During the autopsies, Ducky and Gibbs discover that the three additional victims had gang tattoos. With this crucial piece of information, the team works to uncover the Marine\'s connection with a deadly street gang.', 'https://image.tmdb.org/t/p/original/zDF4r4GB51XouXX7hEyhEW35jfB.jpg'),
(66, 3, 20, 'Untouchable', 'When a Pentagon cryptographer is found dead, the NCIS team has to discover whether the person was or wasn\'t a Pentagon mole, and if the person committed suicide. As the investigation continues, the team discovers that the person wasn\'t alone when she died, so someone must have murdered her. So, the team has to find the person, a mole, who murdered the cryptographer.', 'https://image.tmdb.org/t/p/original/z0XHty0dfXdBLUyJPstjCICaNom.jpg'),
(67, 3, 21, 'Bloodbath', 'While working on just a regular murder case with the rest of the NCIS team, Abby is almost killed by an evidence from the case and soon it becomes clear that the murder was staged, and that someone wants Abby dead. The team discovers some enemies from Abby\'s past, and they must find out who is the person, before the person kills Abby.', 'https://image.tmdb.org/t/p/original/i1seDDmIvaeGxg7WUVCv5j4MPtU.jpg'),
(68, 3, 22, 'Jeopardy', 'The NCIS team must protect Ziva when a suspect dies while being in custody, and her tactic might be the reason why the person died. The things become much more dangerous when the suspect\'s brother kidnapps Jenny, and demands the release of his brother in exchange for Jenny, but he has no idea that his brother is dead.', 'https://image.tmdb.org/t/p/original/gzttHEfyPHD3TIfMB1vWK9dOPHb.jpg'),
(69, 3, 23, 'Hiatus (1)', 'While working on an assignment, Gibbs is seriously injured in an explosion, and taken to a hospital, where he recalls his painful past, which he has always hidden from others. The rest of the team must proceed with the investigation and put their feelings towards Gibbs\'s injury aside. Tony is left in charge, which may cause a bit of trouble.', 'https://image.tmdb.org/t/p/original/3iZHPoLecbCkX6NRHRW5II9Ht76.jpg'),
(70, 3, 24, 'Hiatus (2)', 'The NCIS team must work on an assignment against a terrorist group without Gibbs, who is still recovering from the explosion. Gibbs has to fight with memory loss, while he\'s visited by his mentor and his former boss. His help is needed, expecially when the team discovers that Gibbs is the only person who has informations about the terrorists\' plans, so he needs to retrieve his memory before the terrorists attack.', 'https://image.tmdb.org/t/p/original/mbz5kEkw5oss4ytKyikqptW3WXn.jpg'),
(71, 4, 1, 'Shalom', 'When Ziva accidentally witnesses a political assassination, she must surrender to the FBI and deal with the consenquences without Gibbs\'s help, who is now enjoying his retirement. She learns that the FBI is looking for her and escapes, while the NCIS team, leaded by Tony, must prove that Ziva is innocent. However, when things get more complicated, Ziva seeks help from the one person that always trusted her, Gibbs.', 'https://image.tmdb.org/t/p/original/7MzU7xJSLHy2IKRKbyFO32ug5RG.jpg'),
(72, 4, 2, 'Escaped', 'Gibbs is forced to come back out of his retirement to help Fornell, who is being threatened by a convict that escaped from prison. The convict threatens both Fornell and his daughter Emily. Gibbs and the NCIS team re-open the convict\'s old robbery case, and question a retired sailor who is the only one who contacted the convict after he was sent to prison. The investigation will lead the NCIS team to a surprising discovery.', 'https://image.tmdb.org/t/p/original/A4vwHj73oPHeXHLmwJeYdbE0AnS.jpg'),
(73, 4, 3, 'Singled Out', 'An abandoned car is found full of blood, registered to a missing Navy lieutenant. The NCIS team learns that the missing lieutenant was profiling men, trying to find a perfect man for herself. When they find out that the woman intended to go to a seminar at a local hotel, Ziva goes undercover to find more information. Ducky is busy going through the profiles of the men. Jenny makes a secret offer to Tony.', 'https://image.tmdb.org/t/p/original/wkxIbvgEtBbPg3fzl8UgRxWbrZ.jpg'),
(74, 4, 4, 'Faking It', 'After police pull over a driver and arrest him for a concealed weapon, a car crashes into their patrol car with a dead man behind the wheel. The arrested man turns out to be Russian and Homeland Security claim he was working for them. The Russian is linked to an old case that Mike Franks worked on. Mike comes out of retirement to put the Russian behind bars.', 'https://image.tmdb.org/t/p/original/4zEi3zTX9EnkMHKg5gyO1GBIQjr.jpg'),
(75, 4, 5, 'Dead and Unburied', 'When a missing Lance Corporal is found dead in a vacant house, the NCIS team discovers that he was buried in the backyard and then exhumed. They learn about his identity and that he was to be deployed to Iraq, but he never showed up for duty. The investigation leads them to a new clue---he had two fiancées. Abby runs the DNA samples from the two women to find out if the DNA is a match to the soil found on the dead man\'s body.', 'https://image.tmdb.org/t/p/original/gB4ZwrwepRlQS7Tnns6DppWcrib.jpg'),
(76, 4, 6, 'Witch Hunt', 'It\'s Halloween and the NCIS team is busy investigating a ransom case. A Marine\'s daughter has been kidnapped after the kidnapper attacked a Marine in his home. The investigation leads them to a fact that the couple has been separated. They decide to focus on the wife\'s ex-boyfriend, after learning that the woman is the one who destroyed their marriage. Meanwhile, McGee and Tony are stunned by Abby\'s Halloween costume.', 'https://image.tmdb.org/t/p/original/huUoQySbeFvK9ZRtYW2FbTydTIp.jpg'),
(77, 4, 7, 'Sandblast', 'When a Marine Colonel dies in an explosion at a military golf course, the NCIS team must investigate a suspected terrorist attack with the help from the Army Criminal Investigative Division (CID). The CIA gives them a lead to an abandoned warehouse, but it turns out to be a trap---the warehouse is set to explode. McGee uses his computer skills to break into the secret government files to uncover the terrorist cell.', 'https://image.tmdb.org/t/p/original/cwAlDnIm65svM5fFOpaa9cxTbxF.jpg'),
(78, 4, 8, 'Once a Hero', 'When an honored Marine veteran is found dead in a hotel, the NCIS team must find out what happened to him. Soon they realize that the Marine didn\'t commit suicide and that he was a homeless man. After going through his stuff, they find compromising evidence against him, and Gibbs is determined to prove the man\'s innocence.', 'https://image.tmdb.org/t/p/original/jSIg9F42dFhBiD3OddS0PWK4Gov.jpg'),
(79, 4, 9, 'Twisted Sister', 'McGee breaks the rules, risking his NCIS job, to help his sister Sara, who shows up disoriented and bloodied. While he works on figuring out what happened to his sister, the NCIS team is investigating a case of a Navy sailor, who is somehow connected to McGee\'s sister. Both Tony and Abby are busy with love problems, while McGee turns out to have another secret.', 'https://image.tmdb.org/t/p/original/k9z4acuW9FCu9kO9eliCu30Cj87.jpg'),
(80, 4, 10, 'Smoked', 'When a burnt and mummified body of a missing and wanted person is found on a Marine base, in a furnace, NCIS must work with FBI. The burnt man turns out to be a serial killer. The both teams visit the man\'s family and discover something shocking. Also, the NCIS team must deal with the book McGee wrote about them, using \"fictional\" characters.', 'https://image.tmdb.org/t/p/original/lqh3BWQIvIjkm0QzUantWfs2Cbk.jpg'),
(81, 4, 11, 'Driven', 'When a robotic vehicle named \"Otto,\" a part of a high level project of the Department of Defense, causes a death of a Navy Lieutenant, and then later almost kills Abby, the NCIS team must find out who sabotaged the vehicle and murdered the Navy Lieutenant. Meanwhile, Ziva realizes that Tony keeps on visiting the hospital. What is he doing there?', 'https://image.tmdb.org/t/p/original/pOA6vcfO9Zvd478qiLWyFofGHWg.jpg'),
(82, 4, 12, 'Suspicion', 'When a high-level Marine intelligence officer is found murdered in a small motel room, the NCIS team must find the person who murdered him. After discovering that the person was dead for already three days, and that the town authorities already \"investigated\" the crime, Gibbs is determined to solve the case, which could be related to a terrorist cell, and not let the town authorities get in his way.', 'https://image.tmdb.org/t/p/original/qKbrpTJDz53PX5xfoTAHI2PLVku.jpg'),
(83, 4, 13, 'Sharif Returns', 'When the NCIS team learns that the missing 10 kilograms of highly toxic chemical weapons are now in the hands of Mamoun Sharif, a wanted terrorist, they will have to find a way to find the man and stop him before it\'s too late with the aid from Army Lt. Col. Hollis Mann and constant phone calls from Sharif himself.', 'https://image.tmdb.org/t/p/original/3j2XsLLR0YfYYjaTVdj6RAOxCcM.jpg'),
(84, 4, 14, 'Blowback', 'After catching an international arms dealer, the NCIS team learns that Navy\'s highly classified weapons system will be sold to \"La Grenouille,\" an important arms dealer. To stop the transaction, the team will send Ducky undercover. Meanwhile, another government agency appears to be working on the same case, with different plans.', 'https://image.tmdb.org/t/p/original/ncmRylsi5slQ7qkHnYGfOJA0j63.jpg'),
(85, 4, 15, 'Friends and Lovers', 'When a dead body of a sailor is found in an abandoned part of the town, all the evidence seem to point that the person died from unintentional drug overdose, but when the team uncovers more evidence, it turns out to be a murder. Meanwhile, Tony bonds with a local detective while working on the case.', 'https://image.tmdb.org/t/p/original/3S4PMQypZ2BZTCb2XqvnrwxPjO7.jpg'),
(86, 4, 16, 'Dead Man Walking', 'When a Navy Lieutenant becomes the victim of radiation poisoning, the NCIS team must find the person who\'s behind the crime. The Lieutenant, who is working for the IAEA (International Atomic Energy Agency),  claims that only his two colleagues knew about his assignment, and whoever it was, the person tried to stop the Lieutenant\'s next investigation.', 'https://image.tmdb.org/t/p/original/fre2wSDXFNJOG9Z35IsSqpXbFtY.jpg'),
(87, 4, 17, 'Skeletons', 'When an explosion at a military cemetery mausoleum reveals a crypt full of a mixture of body parts, the NCIS team must inform the families of the victims, hoping to find a connection between the dismembered victims, and narrow down the suspects to find out who is behind the hideous crime. Meanwhile, Abby is dealing with a personal problem, and the only person she can talk to about it is Gibbs.', 'https://image.tmdb.org/t/p/original/1IhG6DYmdkqZqtw0pFgSsyejp4E.jpg'),
(88, 4, 18, 'Iceman', 'When a supposedly frozen to death Marine turns out alive on Ducky\'s autopsy table, the NCIS team has to find out about the victim\'s movements last few days to uncover what happened to him and who left him for dead. As the investigation progresses, the team learns about the victim\'s trip to Baghdad via a private cargo plane and discovers a link to Gibbs\' past.', 'https://image.tmdb.org/t/p/original/wiqXs8wzpNUxlH6QvjJIVuBhX1s.jpg'),
(89, 4, 19, 'Grace Period', 'When a weekend call to the NCIS tip line from an unknown source about possible terrorist activity results in the death of two agents sent into a trap, the NCIS team will have to find out who were the people responsible with the help from Agent Paula Cassidy, who holds herself responsible for the tragedy.', 'https://image.tmdb.org/t/p/original/4V24QIA2MNpWHyVVYNGHSwPtiVC.jpg'),
(90, 4, 20, 'Cover Story', 'McGee is under high pressure during the murder investigation of a Petty Officer based on the character for his latest book, with very little information to go on.', 'https://image.tmdb.org/t/p/original/cuqxmu1pnU4odoNdvAwBx2BoaxJ.jpg'),
(91, 4, 21, 'Brothers in Arms', 'Director Shepard makes a huge mistake by meeting a man alone to inform her about Le Grenouille, as their meeting turns into a murder of the informant. Now the NCIS team must gather all the existing info and try to finally hunt down their enemy.', 'https://image.tmdb.org/t/p/original/4l7slBoiWvgVUAdq56ojISVRxf1.jpg'),
(92, 4, 22, 'In the Dark', 'When a blind photographer shoots the body of a Petty Officer on film, the NCIS team uses his special insight to investigate the crime. Meanwhile, both Gibbs and Tony are having commitment issues in their relationships.', 'https://image.tmdb.org/t/p/original/zro9zT4i7LaThs70MWBgYbjaolC.jpg'),
(93, 4, 23, 'Trojan Horse', 'When Jenny has to attend an overseas conference, Gibbs is made acting director, but he prefers to ignore his duties and lead the investigation of the murder of a man, who was found dead in a taxi headed to the NCIS headquarters.', 'https://image.tmdb.org/t/p/original/gTifhtpNkjO9JNeosqLFQBtJRfI.jpg'),
(94, 4, 24, 'Angel of Death', 'When Jenny returns from her European trip, the entire NCIS team will be forced to take a Homeland Security polygraph test, and the deepest secrets of each agent are about to be revealed. Plus, an unarmed Tony and Jeanne are held hostage by a ruthless drug dealer.', 'https://image.tmdb.org/t/p/original/uJ7FducqFKH3nyMhTJ2jG0vy5vW.jpg'),
(95, 5, 1, 'Bury Your Dead', 'The NCIS team uncovers a huge secret, as their mission to capture La Grenouille comes to an explosive and deadly conclusion.', 'https://image.tmdb.org/t/p/original/jHOXj5Vf7FaoY513Xbv5RP0YFMF.jpg'),
(96, 5, 2, 'Family', 'During an autopsy, Ducky makes a startling discovery that turns a murder of a Petty Officer into a search for a missing infant. Meanwhile, Tony has to deal with his feelings for Jeanne.', 'https://image.tmdb.org/t/p/original/y5z4UxWXEQ4QpiJwFlkRG2Oc6Ei.jpg'),
(97, 5, 3, 'Ex-File', 'Lt. Colonel Mann joins Gibbs in an investigation of the murder of a Marine Captain who had access to highly classified information. Things get very personal for Gibbs when one of the witnesses in the case turns out to be one of his ex-wifes.', 'https://image.tmdb.org/t/p/original/oBndQ4rZDsNOncvsi7LEnfgrdYE.jpg'),
(98, 5, 4, 'Identity Crisis', 'When Ducky realizes that one of his cadavers used for research is actually a victim of murder, the NCIS team identifies him as a criminal genius who is capable of deleting the past.', 'https://image.tmdb.org/t/p/original/7ATviYwpvJW0WlGGLzx83at0CIw.jpg'),
(99, 5, 5, 'Leap of Faith', 'The NCIS team is called in to stop a naval officer from committing suicide by jumping off a rooftop, but when the suicide attempt turns into a murder, the NCIS team will have to find out who did it.', 'https://image.tmdb.org/t/p/original/hgoFpQJOZQfr7Sab2F0i8gbvNMQ.jpg'),
(100, 5, 6, 'Chimera', 'While investigating a mysterious death on a top-secret naval research ship at sea, the NCIS team comes upon an abandoned ship which contains a deadly secret that may cost them their lives.', 'https://image.tmdb.org/t/p/original/oU9gTllkeTkMCecvCnbGmby7ETV.jpg'),
(101, 5, 7, 'Requiem', 'Gibbs finds himself emotionally challenged when he agrees to investigate a crime connected to a friend of his daughter, who passed away years ago, and the investigation leads to a shocking conclusion.', 'https://image.tmdb.org/t/p/original/n22NEJYtgQXNchUzXx1XUDNC1sj.jpg'),
(102, 5, 8, 'Designated Target', 'A murder investigation of a Navy Admiral takes a shocking turn when a woman, a political refugee, returns home to search for her husband.', 'https://image.tmdb.org/t/p/original/9ia4Sqc0pkpgwGl4BZmUDWipXvU.jpg'),
(103, 5, 9, 'Lost and Found', 'The NCIS team has to babysit a 9-year-old son of a missing man, a survivalist who is somehow connected to a cold case murder. The investigation leads the team into the wilderness, where they discover a shocking truth about the man\'s past.', 'https://image.tmdb.org/t/p/original/5h6iw4cVDXgpGYTwP4DyaYkf5C7.jpg'),
(104, 5, 10, 'Corporal Punishment', 'While trying to track down a delusional and violent Marine who thinks he\'s still in Iraq, the NCIS team will learn that the man has been the subject of a secret experiment - and it comes with a high price to pay.', 'https://image.tmdb.org/t/p/original/3REjlteHws47MrvcPycN8zrGFGH.jpg'),
(105, 5, 11, 'Tribes', 'After a young Muslim Marine is murdered near his Mosque, Ducky refuses to perform autopsy due to his religious beliefs, so the NCIS team tries to talk to the father of the deceased, and they send McGee to plant a bug in the Mosque, only to discover that the FBI already planted their bug.', 'https://image.tmdb.org/t/p/original/udyWKBAoOJutoSCtgJf4d8jMAks.jpg'),
(106, 5, 12, 'Stakeout', 'The NCIS team goes on a stakeout in a warehouse to catch a suspected thief of a high-tech naval radar, but they accidentally end up witnessing a murder. Meanwhile, Ducky hides a secret from the rest of the team.', 'https://image.tmdb.org/t/p/original/zmjh6TeRaClY3L22qosbOgl3AcP.jpg'),
(107, 5, 13, 'Dog Tags', 'When a dog owner is found murdered, the NCIS team must determine if his dog committed the murder or not, and Abby decides to fight for the dog\'s life by trusting her instinct about the dog\'s innocence. Meanwhile, Gibbs learns about Jenny\'s secret.', 'https://image.tmdb.org/t/p/original/gFfxjyHRofvVww3Q59K14xzJCHU.jpg'),
(108, 5, 14, 'Internal Affairs', 'The dead body of La Grenouille finally surfaces and the entire NCIS is put under the investigation by the FBI, with Jenny as the prime suspect for his murder.', 'https://image.tmdb.org/t/p/original/6IZkGimRgu5YtoGogSciEwQNxvv.jpg'),
(109, 5, 15, 'In the Zone', 'Two members of the NCIS team are sent to Baghdad to investigate a Mortar attack that turned into a murder investigation.', 'https://image.tmdb.org/t/p/original/hA4TXlrYFwJl3wIjBP3RXfw9nvJ.jpg'),
(110, 5, 16, 'Recoil', 'While on an undercover mission, Ziva\'s life is put in grave danger when the serial killer she\'s been tracking becomes suspicious of her.', 'https://image.tmdb.org/t/p/original/8D1CNFql44wZUfzVeeXF9gl7zNk.jpg'),
(111, 5, 17, 'About Face', 'Palmer is put in grave danger when he becomes the target of an anonymous murderer, whom only he can recognize.', 'https://image.tmdb.org/t/p/original/gupmG0quLGqOjwh5CPkckh9Qhcd.jpg'),
(112, 5, 18, 'Judgment Day (1)', 'When a former NCIS agent is found dead, the entire team is put in danger as they hunt after the killer.', 'https://image.tmdb.org/t/p/original/qvSgrTYTBnrBGlpPg2QbcpKwJRS.jpg'),
(113, 5, 19, 'Judgment Day (2)', 'When one of their own is killed, the team must find the killer before they get to another member of the team, Gibbs. In an emotional investigation, the team tries to stay together, against the wishes of Assistant Director Vance.', 'https://image.tmdb.org/t/p/original/bVSaabXYACj7x3SoBrnVV8vCXoR.jpg'),
(114, 6, 1, 'Last Man Standing', 'When a petty officer is found murdered, Gibbs learns about the mysterious connection between the disbanding of his team and the case.', 'https://image.tmdb.org/t/p/original/bV3b2kR6Qu77FqerItgP9kbzeAQ.jpg'),
(115, 6, 2, 'Agent Afloat', 'DiNozzo\'s investigation into a Navy Lieutenant\'s apparent suicide takes a surprising and deadly turn when its seems that it might have a connection to a larger, deadly scheme.', 'https://image.tmdb.org/t/p/original/9X7kvMzP43607TTPiuF9I1browe.jpg'),
(116, 6, 3, 'Capitol Offense', 'A distinguished senator asks Gibbs for help in solving the murder of a young female Naval officer.', 'https://image.tmdb.org/t/p/original/d1M3VrDnANjWPDnyFS57keGms5a.jpg'),
(117, 6, 4, 'Heartland', 'When a murder investigation leads the team to Gibbs\' hometown, secrets about his past are revealed.', 'https://image.tmdb.org/t/p/original/nmBnfIbWxe4GbqRvDeRs8kp6UCk.jpg'),
(118, 6, 5, 'Nine Lives', 'Gibbs\' hunt for the killer of a marine puts him on a collision course with an old friend.', 'https://image.tmdb.org/t/p/original/lXtUKv4d917jZ4AZVxeRaRxXcYK.jpg'),
(119, 6, 6, 'Murder 2.0', 'Gibbs and his team are searching for a cyber serial killer who takes videos of his victims. The team quickly finds out that the video\'s of the dead victims are false.', 'https://image.tmdb.org/t/p/original/n7Rl5JYgcXbZTHcTLCPnGrLIjUt.jpg'),
(120, 6, 7, 'Collateral Damage', 'A Navy bank has been robbed. NCIS is responsible for the investigation. One of the new recruits assigned to the fraud unit, Special Agent Dwayne Wilson, joins the team to help.', 'https://image.tmdb.org/t/p/original/hNZttdr51VwuN265OLrGuWeDNQK.jpg'),
(121, 6, 8, 'Cloak', 'A strange delivery in a box arrived at the Navy facilities: The delivery driver and a Navy MP officer discover it is a sailor\'s corpse.\n\nA shocking revelation comes to light after the team is forced into playing a dangerous war game.', 'https://image.tmdb.org/t/p/original/dP6PR2yGkv63vKCqAjMvem5SHZu.jpg'),
(122, 6, 9, 'Dagger', 'The team is forced to rely on information from questionable sources while trying to stop a criminal bent on stealing government secrets.', 'https://image.tmdb.org/t/p/original/lwY1Pl57O9T3zeuctHbMJcisxJK.jpg'),
(123, 6, 10, 'Road Kill', 'The team investigates the death of a petty officer and discovers he may have been leading a violent secret life.', 'https://image.tmdb.org/t/p/original/fpIA06jD1PjM4OYl4bux1fW4YJo.jpg'),
(124, 6, 11, 'Silent Night', 'During the week of Christmas, The Team is Forced to work overtime when they discover their prime suspect had been dead for 17 years.', 'https://image.tmdb.org/t/p/original/qXm0ktXApf2nR3z3FKjlx0MXHAh.jpg'),
(125, 6, 12, 'Caged', 'The NCIS team must reveal the truth behind the murder of a jail guard which resulted in a prison riot and McGee being held captive by the inmates.', 'https://image.tmdb.org/t/p/original/wbDrSWn59SjLbm33S2CoMLjMslr.jpg'),
(126, 6, 13, 'Broken Bird', 'Secrets from Ducky\'s clandestine past come to the forefront after he\'s attacked at a crime scene. The team uncovers disturbing secrets from the good doctor\'s past.', 'https://image.tmdb.org/t/p/original/8cdQokfLusnanSReExBcELkR3mi.jpg'),
(127, 6, 14, 'Love and War', 'The team discovers a link between a sergeant\'s murder and his possibly treasonous private life.', 'https://image.tmdb.org/t/p/original/mtpi5ak86PD3V6ARsHHXzdTOSak.jpg'),
(128, 6, 15, 'Deliverance', 'Demons of the past come back to haunt Gibbs when he finds a cryptic message waiting for him at a crime scene.', 'https://image.tmdb.org/t/p/original/7tJFgS3XPU4BBCohdqWsUwhziAE.jpg'),
(129, 6, 16, 'Bounce', 'A murder prompts the reopening of one of Tony\'s old investigations, leading Gibbs and DiNozzo to reverse roles to solve the case.', 'https://image.tmdb.org/t/p/original/lprn5kr9cGZkSr7kNwBEOXwl4Mz.jpg'),
(130, 6, 17, 'South by Southwest', 'When a fellow agent is murdered, the NCIS teams heads into the desert to locate a woman who might hold the answer to the mystery murder.', 'https://image.tmdb.org/t/p/original/9TiQ9k3I6IjQ9eTzi5JByT7OJfg.jpg'),
(131, 6, 18, 'Knockout', 'The death of a boxer leads Vance to borrow the NCIS team and start investigating his death, while Gibbs digs into Vance\'s past.', 'https://image.tmdb.org/t/p/original/iEBzdURgex2xDg5DhcZiCSoS7n.jpg'),
(132, 6, 19, 'Hide and Seek', 'When a young boy finds a murder weapon, the team must trace ownership of the gun to find who used it last and who was murdered.', 'https://image.tmdb.org/t/p/original/yyLNWOe6hHWuaErjIOEaOZ1Gz7u.jpg'),
(133, 6, 20, 'Dead Reckoning', 'Gibbs and the team must work with the shady Trent Kort to put away one of NCIS\'s most wanted.', 'https://image.tmdb.org/t/p/original/pxkWIvOAC27iRLqlzJnboJzEBB.jpg'),
(134, 6, 21, 'Toxic', 'When a government scientist goes missing, Abby is recruited to carry on his work, but the team worries that she may meet the same fate as her predecessor.', 'https://image.tmdb.org/t/p/original/iNI6lCaR0g5CKkzFfLoJhkgpTbf.jpg'),
(135, 6, 22, 'Legend (1)', 'The body of a Marine leads Gibbs and McGee to the NCIS OSP division in Los Angeles, where a murder investigation quickly climbs to a matter of national security in which the two offices must work together to resolve. Meanwhile, Tony begins to snoop into Ziva\'s personal life.', 'https://image.tmdb.org/t/p/original/z93AL1CX2rdzQ06PEiq0uTtfmCp.jpg'),
(136, 6, 23, 'Legend (2)', 'With the appearance of Mossad agent Michael Rivkin, Tony is forced to question Ziva’s loyalty to NCIS. Meanwhile, in Los Angeles, Special Agent Callen goes undercover to try to catch a terrorist cell while OSP psychologist Nate Getz discovers the startling truth about Gibbs and Special Agent Lara Macy’s relationship.', 'https://image.tmdb.org/t/p/original/vYrN9bgfkhAZBu0cObmH3b6MYSA.jpg'),
(137, 6, 24, 'Semper Fidelis', 'After a security breach at the SecNav\'s residence leads to the death of an ICE agent, Gibbs and the team are forced to work with ICE and the FBI to find his killer. Meanwhile, Tony finally comes face-to-face with Michael Rivkin.', 'https://image.tmdb.org/t/p/original/9AhPbuiZaYFURz7ocXhCSG3Z9GX.jpg'),
(138, 6, 25, 'Aliyah', 'Ziva\'s homecoming to Israel with Gibbs and the team is not a happy reunion with her father, the enigmatic and powerful head of Mossad. As tensions rise, Gibbs is forced to make a decision that sends shock waves through NCIS.', 'https://image.tmdb.org/t/p/original/gTZgYUM8IZTPB0UHGaVnMCNpWdh.jpg'),
(139, 7, 1, 'Truth or Consequences', 'As the hunt for Ziva\'s replacement begins, Gibbs and his remaining team members must head back to work with the past still weighing heavily on their minds.', 'https://image.tmdb.org/t/p/original/5WZJspVtIThloQd8KTjVsvDIul9.jpg'),
(140, 7, 2, 'Reunion', 'The team discovers the bizarre death of a Marine and his two friends may be linked to their past, but its Gibbs who ends up taking a trip down memory lane.', 'https://image.tmdb.org/t/p/original/8afO82loxMoYu51MoNBY20gTgQw.jpg'),
(141, 7, 3, 'The Inside Man', 'The team must take a second look into the death of a lieutenant after the blogger who accused them of a cover-up ends up dead.', 'https://image.tmdb.org/t/p/original/emRdBMFpbCgtFmMAGuOGt2pej0c.jpg');
INSERT INTO `ex_episodes` (`epid`, `epseason`, `epnum`, `eptitle`, `epintro`, `epimg`) VALUES
(142, 7, 4, 'Good Cop, Bad Cop', 'When a Marine\'s body surfaces halfway around the world, the investigation forces Ziva to dig up a buried chapter of her life.', 'https://image.tmdb.org/t/p/original/e2QxPAtz8WJGyV1Ak1vkI5g6Jlj.jpg'),
(143, 7, 5, 'Code of Conduct', 'When a Marine known for his practical jokes is found dead on Halloween Eve, the NCIS team discovers that the victim\'s \"good-natured\" pranks may have inspired ghoulish retribution. Meanwhile, Ziva tries to adjust to her new role on the team.', 'https://image.tmdb.org/t/p/original/c9r88mESch8ibUWyaicZRI8foHM.jpg'),
(144, 7, 6, 'Outlaws and In-Laws', 'A murder investigation prompts Gibbs and the team to play family counselor to his former mentor, Mike Franks, in the hopes of preventing a bloody international conflict.', 'https://image.tmdb.org/t/p/original/trYIp0yUP31z19jFCMXDDmke0aB.jpg'),
(145, 7, 7, 'Endgame', 'With the team\'s help, Vance faces his demons while uncovering a complex relationship with a killer that puts his whole family in danger.', 'https://image.tmdb.org/t/p/original/cR5pvpqOcOJREHydOVEtbAfeP3O.jpg'),
(146, 7, 8, 'Power Down', 'The team literally finds themselves in the dark when the investigation into the death of a lieutenant is connected to a city-wide blackout.', 'https://image.tmdb.org/t/p/original/sF8UM0Yf4ShobrevsOAWuOn4RAL.jpg'),
(147, 7, 9, 'Child\'s Play', 'Dead Marine\'s day job at a government think tank leads Gibbs and the team into the life of a 12-year-old prodigy who may be the killer\'s next target.', 'https://image.tmdb.org/t/p/original/q3NdmtDzL0TjeXxLuwD87GdaoON.jpg'),
(148, 7, 10, 'Faith', 'The body of the son of a retired Colonel-turned-preacher is found and the team have their suspicions that he may be the victim of a hate crime. Meanwhile, Gibbs gets a holiday visit from his father.', 'https://image.tmdb.org/t/p/original/zqQ9gCMDJZPUVao85NN5CWVjFMW.jpg'),
