(190, 9, 4, 'Enemy on the Hill', 'The NCIS team searches for the person and motive behind a contract killer targeting a Navy Lieutenant Commander.\n\nMeanwhile, Abby uncovers new information about her family after undergoing tests for a kidney donation.', 'https://image.tmdb.org/t/p/original/rZZMVAFT2qJBaVbqCwEtKLXiv1q.jpg'),
