(193, 9, 7, 'Devil\'s Triangle', 'The NCIS team searches for answers when the current husband of both Gibbs\'s and Fornell\'s ex-wife is suspiciously kidnapped.', 'https://image.tmdb.org/t/p/original/pdeV9fcs7LYR9KKh0q1Mcw94dxH.jpg'),
(194, 9, 8, 'Engaged (1)', 'The NCIS team uncovers a discrepancy with DNA remains when investigating the crash of a military plane that had been transporting caskets.', 'https://image.tmdb.org/t/p/original/humv4bBKDeIOLCdJr9d3SGdHHnc.jpg'),
