(197, 9, 11, 'Newborn King', 'When a Navy captain is killed in a hotel room, NCIS must track down and protect his very pregnant companion from unknown assailants. Meanwhile, Jimmy has problems of his own when he brings his future father-in-law to work.', 'https://image.tmdb.org/t/p/original/uO2Rl15jWlSx3XgXCdDP0xc2DLH.jpg'),
