(199, 9, 13, 'A Desperate Man', 'When a Navy lieutenant commander is found dead in a building under construction, NCIS must search for a killer while dealing with interruptions from her distraught detective husband. Meanwhile, Ray’s return has Ziva thinking about her future.', 'https://image.tmdb.org/t/p/original/m7NY9Dg8LtQswpBwGV3rkmYz5LG.jpg'),
(200, 9, 14, 'Life Before His Eyes', 'During a routine stop for his morning coffee, Gibbs finds himself staring down the barrel of a gun, forcing him to question choices he has made in the past and present', 'https://image.tmdb.org/t/p/original/lopn9ZzbybIiWVP1Ywaj4wSNbhA.jpg'),
(201, 9, 15, 'Secrets', 'When a Navy captain is found dead with an unusual costume hidden under his uniform, NCIS uncovers a secret society of real-life super heroes and must track down the villain.', 'https://image.tmdb.org/t/p/original/pVcJ0g65EuaSqV9bz149M5409ef.jpg'),
(202, 9, 16, 'Psych Out', 'Gibbs clashes with Dr. Samantha Ryan (guest star Jamie Lee Curtis) over the truth behind a navy reservist\'s possible suicide', 'https://image.tmdb.org/t/p/original/t7o41cdjDLX46xTTmIbENg2n6VI.jpg'),
(203, 9, 17, 'Need to Know', 'Top-secret clearance from a Naval research laboratory is jeopardized when the murder of a Chief Petty Officer is connected to an international arms dealer. Meanwhile, Probationary Agent Ned Dorneget tries to butter up Gibbs in hopes of joining the team.', 'https://image.tmdb.org/t/p/original/mnnPfnnP5SSqAlHWJnVTzf2rS34.jpg'),
(204, 9, 18, 'The Tell', 'The Secretary of the Navy partners Gibbs with Dr. Samantha Ryan after top secret information is leaked by someone on the inside.', 'https://image.tmdb.org/t/p/original/giTwxDmGpgMk5WhBA5WyFHxIF8P.jpg'),
(205, 9, 19, 'The Good Son', 'A case hits close to home when the lead suspect in the murder of a petty officer is Director Vance\'s brother-in-law.', 'https://image.tmdb.org/t/p/original/rokecYkFQbFYGjLiuUupdjJXbVO.jpg'),
(206, 9, 20, 'The Missionary Position', 'Following the murder of a Marine, Tony and Ziva join Ziva’s longtime friend and mentor in Columbia in a search for a missing Marine Lieutenant and Navy Chaplain. Meanwhile, Jimmy Palmer decides who will be his best man.', 'https://image.tmdb.org/t/p/original/hiEYDOYubej8zMKOYIpfCBTolIU.jpg'),
(207, 9, 21, 'Rekindled', 'After a warehouse fire reveals missing Navy documents, posing a potential threat to national security, the NCIS team joins the Baltimore P.D. investigation, reuniting Tony with a boy from his past.', 'https://image.tmdb.org/t/p/original/zN5AMKvfF9dGmYt94PD2LR88DPn.jpg'),
(208, 9, 22, 'Playing with Fire', 'The NCIS investigation of a fire on a Navy vessel reveals evidence that elevates security at all U.S. Navy facilities worldwide. Meanwhile, DiNozzo and Ziva travel to Italy when an explosive device is found hidden on a Navy ship.', 'https://image.tmdb.org/t/p/original/vMltrptEhkPeCdPnn5Ns4iHCeVU.jpg'),
