(210, 9, 24, 'Till Death Do Us Part', 'Terrorism shakes the foundations of the Navy and NCIS to such an extent that Gibbs and the team face surprises that will devastate them.', 'https://image.tmdb.org/t/p/original/sB1mmYSsC8LTgqr8bc8RCFNI0dQ.jpg'),
(211, 10, 1, 'Extreme Prejudice', 'With NCIS headquarters damaged by the bomb. Gibbs goes on the hunt for Harper Dearing and to bring him down once and for all.', 'https://image.tmdb.org/t/p/original/uEEgjx7KjUdSxkhZaKxhRdzY4dU.jpg'),
(212, 10, 2, 'Recovery', 'When the body of a missing NCIS facilities manager is found four months after disappearing on the day of the Navy Yard bombings, the NCIS team is assigned to investigate the strange case for one of their own. Meanwhile, the team is required to complete mandatory psych evaluations with a crisis counselor, and Gibbs is most concerned about Abby’s recurring nightmares since the bombing.', 'https://image.tmdb.org/t/p/original/zcbp5hovpNYOgQrumnJ9tKoWZT4.jpg'),
(213, 10, 3, 'Phoenix', 'While on medical leave, Ducky orders the exhumation of a Navy commanders body from a case closed 12 years ago. As a result, Gibbs tasks Ducky with a slightly different role on the investigation. Meanwhile, the NCIS team investigates the recent death of a Marine. As both cases unfold, the team begins to question whether the two are somehow connected.', 'https://image.tmdb.org/t/p/original/uz3HXs5RVEtrJxwhv56NnZSXIRP.jpg'),
(214, 10, 4, 'Lost at Sea', 'When a helicopter crew is adrift at sea and later discovered on shore, the NCIS team must determine the cause of the crash and locate the missing pilot. Meanwhile, Tony and McGee channel their inner “Maverick” and “Iceman,” a la “Top Gun,” and Ziva challenges them to a dare.', 'https://image.tmdb.org/t/p/original/e5a6cd4keKDgH4bdEWkDCaCI0Sm.jpg'),
(215, 10, 5, 'The Namesake', 'A petty officer is gunned down in a billionaire’s Ferrari and the investigation leads the NCIS team to discover a link to a man Gibbs was named after.', 'https://image.tmdb.org/t/p/original/8KtxXoFfyAlKPIHxnPB0U7306Uf.jpg'),
(216, 10, 6, 'Shell Shock (1)', 'When a Navy Lieutenant who recently returned home from the Middle East is found dead from a brutal attack, the NCIS team questions the victim’s friend, Marine Captain Joe Wescott. Gibbs realizes the Captain is suffering from post-traumatic stress disorder, but knows his experience overseas may also provide a key link to the crime.', 'https://image.tmdb.org/t/p/original/r5BZ19aCtw4DbqWmLJnv9VY166O.jpg'),
(217, 10, 7, 'Shell Shock (2)', 'Gibbs continues to work with Captain Wescott while he retraces his steps in order to help the NCIS team track down a terrorist. With Thanksgiving on the horizon, Abby’s enthusiasm for the NCIS family dinner is building, and Tony’s curiosity is peaking when he learns Ziva is making special plans for the opera.', 'https://image.tmdb.org/t/p/original/r3MFQzfJsJJcc3hXm5sELaOM0xa.jpg'),
(218, 10, 8, 'Gone', 'As the NCIS team investigates a teenage girl’s abduction, Ziva and Abby work closely with her young friend who witnessed the kidnapping. As the investigation unfolds, Gibbs seeks help from a past contact, Miranda Pennebaker, a well-connected woman with questionable morals. Meanwhile, Tony gets jealous when he learns Ziva is making plans with a mysterious man.', 'https://image.tmdb.org/t/p/original/916Izq6EWwutv7MnlWwE0uVbt1K.jpg'),
(219, 10, 9, 'Devil\'s Trifecta', 'Gibbs teams up with FBI Agent Fornell on a joint NCIS/FBI investigation after Fornell becomes the target of a shooting, but they face an unexpected twist in the case when their mutual ex-wife, Diane Sterling, gets involved. Meanwhile, rumors run wild among the group after Diane stays overnight at McGee’s.', 'https://image.tmdb.org/t/p/original/85aoWkhHIPbxAWxKQpAeszRzjWc.jpg'),
(220, 10, 10, 'You Better Watch Out', 'It’s Christmas time and Tony DiNozzo can’t decide if he’ll be naughty or nice when his dad, Anthony DiNozzo, Sr., comes to town for a visit. Meanwhile, the NCIS team is “following the money” in order to solve a murder investigation, and Abby is bursting with excitement over all the holiday festivities.', 'https://image.tmdb.org/t/p/original/k45fqbcEUoC0UI4qgG8QHllJxAZ.jpg'),
(221, 10, 11, 'Shabbat Shalom', 'While the NCIS team investigates the link to a dead journalist and a Navy petty officer, Ziva is taken aback by the sudden emotional visit by her father, who she hasn\'t seen in more than two years. While Ziva questions the purpose of her father\'s visit as the Director of Mossad, her father insists he is in the U.S. strictly to see his daughter for Shabbat dinner.', 'https://image.tmdb.org/t/p/original/dfCI0h7LUnvF6tdC9KWu62kXbJU.jpg'),
(222, 10, 12, 'Shiva', 'In the aftermath of an event that strikes close to home, the NCIS team unites to seek answers and demand justice in order to protect their most vulnerable colleagues.', 'https://image.tmdb.org/t/p/original/sQeT9AKjDg5v2CzFLyC2gwb6lEq.jpg'),
(223, 10, 13, 'Hit and Run', 'The NCIS team investigates a Marine’s car accident and ignites some upsetting past memories for Abby as a young girl on the trail of her first “case”.', 'https://image.tmdb.org/t/p/original/y58thwXnoILwZ9ZiX4yaL4rhG0M.jpg'),
(224, 10, 14, 'Canary', 'The NCIS team takes on a renowned hacker who could hold the key to tracking down the most-wanted cyber-terrorist in the world, on NCIS.', 'https://image.tmdb.org/t/p/original/u1wfLrY8QxShMNwBomXm1QUOoYd.jpg'),
(225, 10, 15, 'Hereafter', 'On leave from NCIS while still grieving the loss of his wife and his kids’ mother, Director Vance discovers unexpected personal information that causes him to question everything.', 'https://image.tmdb.org/t/p/original/mlOvAnewXAzH9PfliQhAHWrCAzG.jpg'),
(226, 10, 16, 'Detour', 'The NCIS team races to track down Ducky and Jimmy after the two disappear while transporting a body from a crime scene.', 'https://image.tmdb.org/t/p/original/2tpiqGhU4TMkLijvWy8vcwD4yYc.jpg'),
(227, 10, 17, 'Prime Suspect', 'A media frenzy surrounding an unidentified criminal prompts Gibbs’ barber to question his son’s involvement and ask for Gibbs’ help in ruling out his son as a prime suspect.', 'https://image.tmdb.org/t/p/original/nQRMX614zn7XsykScu1uvAEbVwq.jpg'),
(228, 10, 18, 'Seek', 'A widowed Marine wife, whose husband was seemingly killed by a Taliban sniper, asks Gibbs\' help to find out the truth. Meanwhile Vance is conducting interviews for a nanny.', 'https://image.tmdb.org/t/p/original/cEwZQAPRUKxCedTDp3qBUqwv5e3.jpg'),
(229, 10, 19, 'Squall', 'The team investigates death of a navy medical officer aboard a ship that went through a storm. The prime suspect turns out to be a 4-star admiral, who is also McGee\'s estranged father.', 'https://image.tmdb.org/t/p/original/gp2p1U3IHzKomh6lrzG3XjVBn0m.jpg'),
(230, 10, 20, 'Chasing Ghosts', 'While the team takes a missing persons case, Tony is disturbed by Ziva\'s way of coping with her father\'s death.', 'https://image.tmdb.org/t/p/original/mG9XKVQBDRKxKiWhuIwa7IMhfGi.jpg'),
(231, 10, 21, 'Berlin', 'Ziva continues to pursue revenge against Eli\'s killer, Ilan Bodnar, and Vance continues to endorse her actions despite orders from Homeland Security to rein them in.', 'https://image.tmdb.org/t/p/original/gzNh9zbotIbWfpMYXe2Zfzijf2W.jpg'),
(232, 10, 22, 'Revenge', 'In retaliation for the murders of Eli David and Jackie Vance, the NCIS team feverishly searches for Bodnar despite orders from Homeland Security to relinquish the case.', 'https://image.tmdb.org/t/p/original/jv73xAQYPglppEhlkWrvnrdwTvL.jpg'),
(233, 10, 23, 'Double Blind', 'A Department of Defense investigator scrutinizes the NCIS team’s response to the Bodnar case involving the murder of Ziva’s father and Vance’s wife. Meanwhile, the team examines whether a Petty Officer is suffering from paranoia or if his claims of being followed are tied to a matter of national security.', 'https://image.tmdb.org/t/p/original/ovc29iwtyDIaqRD8BjMyyZkYsWi.jpg'),
(234, 10, 24, 'Damned If You Do', 'The international manhunt for Eli David\'s killer turns into a federal witch hunt against Gibbs and the team, which questions their unconventional methods and threatens their future at the agency.', 'https://image.tmdb.org/t/p/original/8GtMVVeyVO8ZjCKZYfSc31AmYhM.jpg'),
(235, 11, 1, 'Whiskey Tango Foxtrot', 'An explosion at a D.C. event that results in a casualty connected to the agency changes Parsons’ perspective on Gibbs and the NCIS team. Meanwhile, without badges, DiNozzo and McGee investigate the case as civilians, despite the case’s dangerous ties to each of them.', 'https://image.tmdb.org/t/p/original/tf6PZi2Dw2mg00IL2h6RRJWwrjf.jpg'),
(236, 11, 2, 'Past, Present, and Future', 'Determined to locate Ziva, Tony chases leads in Israel in search of her current whereabouts. Meanwhile, Gibbs and the team continue the hunt for Parsa and his growing terrorist ring.', 'https://image.tmdb.org/t/p/original/uF3krw93K6bGBdUItaswyJ5Zzcq.jpg'),
(237, 11, 3, 'Under the Radar', 'The NCIS team must rely on Twitter for a case involving a missing Navy Lieutenant. Meanwhile, McGee misplaces his badge but withholds the information from Gibbs and the authorities.', 'https://image.tmdb.org/t/p/original/d3OLrztIaROc5V76PIOfk86ZqBQ.jpg'),
(238, 11, 4, 'Anonymous Was a Woman', 'Gibbs and McGee travel to Afghanistan when a murder case leads them to an Afghan women’s shelter Mike Frank’s secretly supported for years.', 'https://image.tmdb.org/t/p/original/ao6rVlJMj5ulGRs0sNmVWoWZnQr.jpg'),
(239, 11, 5, 'Once a Crook', 'DiNozzo returns to his Baltimore Police Department days when he sees a felony suspect from a 15-year-old case at the NCIS crime scene of a murdered Petty Officer.', 'https://image.tmdb.org/t/p/original/uDEyHlmtGBLqoFZ8fTPtaJaNnQ5.jpg'),
(240, 11, 6, 'Oil & Water', 'The Coast Guard Investigative Service works with the NCIS team when an explosion occurs on an oil rig; a mysterious prankster targets the team.', 'https://image.tmdb.org/t/p/original/n2x3RqvfbwOIUc6k1v9RrP8eZR0.jpg'),
(241, 11, 7, 'Better Angels', 'After Gibbs leaves mid-case to help his father reconnect with a former war pilot, Tony and McGee argue over who should run lead on the team’s investigation into the murder of a Marine Sergeant.', 'https://image.tmdb.org/t/p/original/l1juXf3G4McWFu6IcZO08w8evoQ.jpg'),
(242, 11, 8, 'Alibi', 'The team is forced to take another look at a hit-and-run murder case; McGee becomes suspicious of Tony\'s unusual behavior.', 'https://image.tmdb.org/t/p/original/nsGVI4pzGGGuV9LkhrWQLgpIYHy.jpg'),
(243, 11, 9, 'Gut Check', 'After discovering the Secretary of the Navy was bugged during a confidential briefing, NSA Analyst Eleanor “Ellie” Bishop, who predicted the security breach in exact detail two years ago, partners with the NCIS team on the case.', 'https://image.tmdb.org/t/p/original/niRsDQKUvcGSfKbDD69K0cREAXJ.jpg'),
(244, 11, 10, 'Devil’s Triad', 'Complications arise when the NCIS team discovers a link between a murder victim and the current boyfriend of Gibbs and Agent Fornell’s ex-wife. Meanwhile, NSA Analyst Ellie Bishop adjusts to joining the NCIS team.', 'https://image.tmdb.org/t/p/original/8fCWXuPqjaVu2Ibx6jgB3K3j3Iz.jpg'),
(245, 11, 11, 'Homesick', 'After a mysterious illness strikes children from military families, Gibbs and the team investigate the cause. Meanwhile, Abby and Jimmy partner with the Naval Medical Research Center to determine the strain of illness, all in hopes of delivering a cure before the holidays.  Also, Director Vance struggles with forgiveness as his estranged father-in-law makes a surprise visit to his home.', 'https://image.tmdb.org/t/p/original/oEtW0jhfFhUM3YSrn08G6g3xpUQ.jpg'),
(246, 11, 12, 'Kill Chain', 'When a stolen drone is linked to the elusive terrorist Parsa, the NCIS team partners with the Department of Defense, including Gibb’s former girlfriend Hollis Mann, to track down the device before it is used for a large scale attack. Meanwhile, McGee hesitates to ask for time off to attend a black-tie gala honoring his girlfriend.', 'https://image.tmdb.org/t/p/original/2TsNTxp2fjLQRq32byij95uZV7n.jpg'),
(247, 11, 13, 'Double Back', 'In an effort to find the terrorist Parsa, Gibbs and the NCIS team track down one of his cohorts using evidence from the drone attack. Meanwhile, an emotionally shaken McGee struggles with the ramifications of the incident.', 'https://image.tmdb.org/t/p/original/znlpwqpBQ43cbgMKum7jBrIbFrg.jpg'),
(248, 11, 14, 'Monsters and Men', 'A port authority officer\'s murder reveals a possible location for Parsa; Bishop reveals a past connection to the terrorist.', 'https://image.tmdb.org/t/p/original/mo2vxWekJw6D4WfJbdODGUYEL1D.jpg'),
(249, 11, 15, 'Bulletproof', 'After uncovering faulty bulletproof vests in a truck filled with stolen U.S.M.C. merchandise, the NCIS team attempts to locate both the source and any vests that had been shipped to military personnel overseas.', 'https://image.tmdb.org/t/p/original/fS7xo3KK8FUSowiZnUJIrF5yg4O.jpg'),
(250, 11, 16, 'Dressed to Kill', 'Someone winds up dead when DiNozzo confronts a man impersonating a Navy officer; DiNozzo\'s father needs to share a secret with his son.', 'https://image.tmdb.org/t/p/original/wIreXXp6nXyJ9oulJvxqijhmYHV.jpg'),
(251, 11, 17, 'Rock and a Hard Place', 'After a bomb detonates in the dressing room at a military charity concert, the NCIS team must determine if the target was a washed-up ‘80s rocker or if the bomb was part of a larger scheme. Meanwhile, Jimmy prepares for fatherhood', 'https://image.tmdb.org/t/p/original/7PebjhgYFCSvhXH5OUnjUiYMXR0.jpg'),
(252, 11, 18, 'Crescent City (1)', 'When a former NCIS agent\'s body washes ashore in New Orleans, Gibbs reunites with NCIS Special Agent Dwayne Cassius Pride (Scott Bakula) to determine if the murder was politically motivated or related to a well-known case.', 'https://image.tmdb.org/t/p/original/tR8ICZIblwclrvhcVhIgWj0pHHF.jpg'),
(253, 11, 19, 'Crescent City (2)', 'Gibbs and Special Agent Pride chase leads in New Orleans after evidence points to a copycat of the infamous Privileged Killer. Meanwhile, Bishop sends DiNozzo a special souvenir from the Crescent City, as DiNozzo, McGee and the FBI continue to track political connections to the case from D.C.', 'https://image.tmdb.org/t/p/original/bLSG2Pc7w9v1PfXuiZzQGrmysiH.jpg'),
(254, 11, 20, 'Page Not Found', 'After returning to her job at the Department of Defense, McGee’s girlfriend Delilah finds a break in a controversial case, prompting her to turn to the NCIS team for help. Meanwhile, McGee talks to DiNozzo about whether he should ask Delilah to move in.', 'https://image.tmdb.org/t/p/original/sjc1hV9ZVQa4dEom9CWljKDUne8.jpg'),
(255, 11, 21, 'Alleged', 'After a Navy officer is found dead on a rural road, the NCIS team must ascertain if the murder was the result of a bar fight or because he knew too much about an attack on a fellow female officer. Meanwhile, DiNozzo and McGee start a juice cleanse to purge their bodies of impurities.', 'https://image.tmdb.org/t/p/original/omKJvTt3HtqFBsMsnJ9dJhdYPHp.jpg'),
(256, 11, 22, 'Shooter', 'When a Marine photographer disappears prior to providing his testimony in an Army court-martial hearing, the NCIS team investigates both the murder he witnessed as well as his current piece on military veterans who are homeless in the D.C. area. Meanwhile, Abby tries to help a young homeless woman reconnect with her family.', 'https://image.tmdb.org/t/p/original/hLZkbKv65HkAeGnuUzNWafwR3t.jpg'),
(257, 11, 23, 'The Admiral\'s Daughter', 'Director Vance gives DiNozzo a special assignment to bring home an Admiral’s daughter from Paris, but he must turn to his NCIS team for help after he enters a controversial crime scene.', 'https://image.tmdb.org/t/p/original/acUQyYHUaPrTArhYfd3UijUwrcf.jpg'),
(258, 11, 24, 'Honor Thy Father', 'The NCIS team investigates whether a fire on a U.S. Navy ship that served as a secret detention site for indicted terrorists was accidental or an intentional diversion for an escape. Meanwhile, Gibbs travels to his childhood home following news of his father’s passing.', 'https://image.tmdb.org/t/p/original/joYidiWSbnMPuNGRVixmTYUdDP0.jpg'),
(259, 12, 1, 'Twenty Klicks', 'Gibbs and McGee travel to Russia to safely escort home an NCIS computer engineer connected to classified intel, but their mission is compromised and they are forced to go off the grid while hunted by a Russian mercenary group. Meanwhile, the team in D.C. frantically uses every asset and inter-agency contact they have in an attempt to locate their missing team members.', 'https://image.tmdb.org/t/p/original/tNtjnHjCwjboO9DWTFles6DYGqf.jpg'),
(260, 12, 2, 'Kill the Messenger', 'When a Navy Lieutenant is killed on his way to a private meeting with the President, the NCIS team must determine if the murder was part of a recent stream of muggings in the area or a targeted hit to keep intel secret.', 'https://image.tmdb.org/t/p/original/b4Zb1Xe5MlZVRLqKjgUKV15NP4W.jpg'),
(261, 12, 3, 'So It Goes', 'Flashbacks into his past help tell the tale for Dr. Mallard as he and Bishop travel to England in search of answers to find out why an Englishman murdered in the United States would have a list of deceased Navy men on his person.', 'https://image.tmdb.org/t/p/original/AggE7BOM2SyNT7S6lhdWtkoWS7F.jpg'),
(262, 12, 4, 'Choke Hold', 'The Secretary of the Navy assigns the NCIS team to a joint terrorism task force after a Naval research scientist is murdered and the lead suspect is wanted by the Russian government. In order to get a jump on the case, Gibbs has DiNozzo run interference with the leader of the task force, FBI Agent Leia Pendergast.', 'https://image.tmdb.org/t/p/original/eIDH0vkKUvbzCUGPBgGVIm9tbdD.jpg'),
(263, 12, 5, 'The San Dominick', 'During a joint Coast Guard and NCIS training exercise at sea, Gibbs and CGIS Agent Borin spot a deceased man overboard, who is discovered to be a missing crew member from a ship 60 nautical miles away. Upon boarding the ship for questioning, Gibbs finds himself on a vessel that has been commandeered by pirates.', 'https://image.tmdb.org/t/p/original/zSo19k3PTe9bxL5dqkYEcn8NPuh.jpg'),
(264, 12, 6, 'Parental Guidance Suggested', 'The NCIS team must determine if the murder of a Navy commander\'s wife is linked to her profession as a therapist or an act of terrorism after finding the commander\'s name on a Jihadist target list. Meanwhile, the team discusses Halloween costumes and Tony\'s recent dating habits.', 'https://image.tmdb.org/t/p/original/ahX80hVP5Bc1sy6CZrxLvbbLp.jpg'),
(265, 12, 7, 'The Searchers', 'After investigating the murder of a retired Master Sergeant, the NCIS team uncovers a fraudulent charity that preys on those searching for missing military personnel. Meanwhile, Bishop agonizes over the results of her probation evaluation, and Tony contemplates adopting stray cat that followed him home.', 'https://image.tmdb.org/t/p/original/eFTHZUiC4fkWxR9tQlVl81LbJg8.jpg'),
(266, 12, 8, 'Semper Fortis', 'While the NCIS team investigates the cause of a hit and run accident that resulted in the death of a Petty Officer, Gibbs searches for a way to clear a Navy Hospital Corpsman, who has served two medical tours in Afghanistan, after she\'s indicted for illegally providing medical aid to the victims of the crash, even though the surviving victims swear by her life-saving techniques.', 'https://image.tmdb.org/t/p/original/iWXQcDqzR2tybkgbWiF66FFBNf5.jpg'),
(267, 12, 9, 'Grounded', 'While stuck at the Dulles airport due to inclement weather, DiNozzo, Bishop and her husband Jake work an NCIS case involving an elevated terrorist threat at Northeast airports during the Thanksgiving travel surge. Jamie Bamber guest stars.', 'https://image.tmdb.org/t/p/original/6GtDAggAxzHRT1cxDdJct6PFrVQ.jpg'),
(268, 12, 10, 'House Rules', 'The NCIS team consults with three cyber-terrorists they imprisoned after a city-wide Internet shutdown the week before Christmas. Also, McGee reflects on the case and Gibbs\' infamous rules as he pens a heartfelt letter to his father.', 'https://image.tmdb.org/t/p/original/jy0XidJKXxy2L9e4KOvDE9JnIwA.jpg'),
(269, 12, 11, 'Check', 'The NCIS team investigates copy-cat crime scenes while Gibbs navigates two ex-wives relentlessly trying to get his attention.', 'https://image.tmdb.org/t/p/original/jixsKT6h1FiQdhBlySoFcRxGcuE.jpg'),
(270, 12, 12, 'The Enemy Within', 'The NCIS team searches for a home-grown terrorist after a rescue mission in Syria reveals an American was involved in the capture of a social worker. Meanwhile, McGee and Bishop question DiNozzo’s unusual behavior.', 'https://image.tmdb.org/t/p/original/noSj19STW6UxCxsiYhiTw3zXBwo.jpg'),
(271, 12, 13, 'We Build, We Fight', 'Gibbs and the team investigate when a Navy lieutenant who is set to be the first openly gay servicemember to receive the Medal of Honor is murdered. Also, as his wife\'s due date approaches, Palmer prepares for fatherhood with an NCIS baby shower. Rocky Carroll makes his directorial debut.', 'https://image.tmdb.org/t/p/original/lFQAAcloVkwr8rF1YjRHl58NHl2.jpg'),
(272, 12, 14, 'Cadence', 'DiNozzo returns to the military academy he attended as a teen after a murdered Marine, who was an alumnus of the school, is found clutching the photo of a current student. Meanwhile, Bishop and her husband invite Gibbs and the team for a special dinner.', 'https://image.tmdb.org/t/p/original/zhSBhCBHwnMRrlb3RqRQ1hSC99i.jpg'),
(273, 12, 15, 'Cabin Fever', 'The NCIS team suspects Gibbs\' arch-nemesis is behind an explosion at a global terrorism summit. Gibbs elects to sit out the investigation in order to help a grief-stricken Fornell, whose life is on the verge of imploding following his wife’s murder.', 'https://image.tmdb.org/t/p/original/wUrKguPPmFlbTU26hPHm369Is2W.jpg'),
(274, 12, 16, 'Blast from the Past', 'A covert identity created for one of Gibbs’ undercover cases from 20 years ago resurfaces when a murder victim is found living under the alias.', 'https://image.tmdb.org/t/p/original/mWePFlGzN7FwDWVOcpVpJUFJ29h.jpg'),
(275, 12, 17, 'The Artful Dodger', 'Evidence in an NCIS murder case reveals a rare painting on loan had been swapped for a fake, prompting DiNozzo, Sr. to share his knowledge and contacts of the black market art world with the team.', 'https://image.tmdb.org/t/p/original/3G89i1SPe29wXIkgS2YI32QC7IY.jpg'),
(276, 12, 18, 'Status Update', 'After the body of a thief is found in a Marine’s house, NCIS discovers the calling card of a terror group Delilah and the Department of Defense have been tracking.', 'https://image.tmdb.org/t/p/original/1dVXUjILRiz68Y87MwZNCnSq4j3.jpg'),
(277, 12, 19, 'Patience', 'The murder of a petty officer sparks a lead in a 40 year old airport bombing cold case that Gibbs and DiNozzo have been assigned to for the past two years.  Also, McGee is jealous that he was not previously briefed on the cold case.', 'https://image.tmdb.org/t/p/original/wDNKlIu7KQ0pGczd0ZDQv7eTw4i.jpg'),
(278, 12, 20, 'No Good Deed', 'DiNozzo is partnered with his girlfriend ATF Special Agent Zoé Keates after evidence reveals that the murder weapon in an NCIS case was originally purchased for the controversial ATF sting operation “Operation Fast and Furious.” Also, Anthony DiNozzo Sr. returns to town for a special dinner to meet his son’s girlfriend.', 'https://image.tmdb.org/t/p/original/mEIMiEP34bMC86dkn6xnHdbA5gx.jpg'),
(279, 12, 21, 'Lost in Translation', 'Gibbs and Bishop travel to Afghanistan after the murder of a Marine in D.C. is linked to a terror group holding another Marine hostage overseas.  Also, DiNozzo is upset that McGee was chosen to be the new face of NCIS for all recruitment brochures,', 'https://image.tmdb.org/t/p/original/4ZdJNLwsbS30HJcfVJDr1y4ThGx.jpg'),
(280, 12, 22, 'Troll', 'Special Agent Ned Dorneget from NCIS cyber operations assists the team when a Navy ensign who worked in the Office of Naval Intelligence is murdered. Also, the team discovers that Jake and Gibbs have become good friends.', 'https://image.tmdb.org/t/p/original/pXOL9ghruQBjT1SG5NgzPm56uig.jpg'),
(281, 12, 23, 'The Lost Boys', 'The NCIS cyber case turns into a united global effort after evidence confirms “The Calling,” an international terrorist group that recruits children through the internet, has been purchasing S-bombs off the black market.', 'https://image.tmdb.org/t/p/original/1TNTmApZT4Pr9FyT5rhKRQittwC.jpg'),
(282, 12, 24, 'Neverland', 'NCIS feverishly investigates a global terrorist group that is recruiting teens via the Internet, following a deadly bombing overseas that results in an emotional and surprising loss for the team.', 'https://image.tmdb.org/t/p/original/r4EQ4UwbTSb3x0O5wsQ5QXPsCsz.jpg'),
(283, 13, 1, 'Stop the Bleeding', 'After being shot, Gibbs fights for his life aboard a Navy hospital ship, while DiNozzo and Joanna travel to Shanghai to try and take down the Calling.', 'https://image.tmdb.org/t/p/original/nskddxxMoIE55RDAJk5zTcTDzs0.jpg'),
(284, 13, 2, 'Personal Day', 'Gibbs calls on the team to assist DEA Agent Luis Mitchell with a case that keeps going cold, but DiNozzo discovers there is more to Gibbs’ personal connection to the agent and his desire to help him succeed. Also, the team gossips about Gibbs’ new look after he replaces his standard military haircut and polo shirt for a modern cut and tailored dress shirt.', 'https://image.tmdb.org/t/p/original/5MQkfVOuHhdXkJB1g0RuAYGvTCA.jpg'),
(285, 13, 3, 'Incognito', 'After a Marine is found murdered in Quantico hours after calling Gibbs to discuss a possible case, Bishop and McGee go undercover as a married couple to run surveillance on a Marine Lieutenant and his wife.', 'https://image.tmdb.org/t/p/original/k9iZl0BvOJoO1iMsLU4Mm7639KF.jpg'),
(286, 13, 4, 'Double Trouble', 'Vance partners with Gibbs and returns to field duty when a murder case is connected to a former NCIS agent he locked up for stealing evidence.', 'https://image.tmdb.org/t/p/original/8CGCdVrr0noWHMzsErgxYVcRAmv.jpg'),
(287, 13, 5, 'Lockdown', 'While visiting a pharmaceutical lab on a murder case, Abby is trapped with no communication to the outside world after armed men take over the building and hold everyone hostage.', 'https://image.tmdb.org/t/p/original/qo0PS1f4DpjgTVCF9873TIResbR.jpg'),
(288, 13, 6, 'Viral', 'When a petty officer’s murder matches the M.O. of a local serial killer, the NCIS team must determine if this is the killer’s latest victim or the work of a copycat. Also, McGee and Delilah must learn to compromise before moving in together.', 'https://image.tmdb.org/t/p/original/zN3qdZ6nGeVPCxvoJ92IbAWp8Cf.jpg'),
(289, 13, 7, '16 Years', 'The NCIS murder case of a retired Navy Lieutenant Commander forces Ducky to reveal his participation in a secret society that solves cold cases.', 'https://image.tmdb.org/t/p/original/5ZRHn7ldlnp0GD1uBWsIdk5GEwZ.jpg'),
(290, 13, 8, 'Saviors', 'DiNozzo is reunited with his ex-girlfriend, Jeanne Benoit, when insurgents in Sudan attack a group of volunteer doctors, including her husband.  DiNozzo and McGee travel to the crime scene for the joint murder and kidnapping case and join the search for the missing doctors.', 'https://image.tmdb.org/t/p/original/mNOS9Er9RrBhP85RzCcNtxDMegJ.jpg'),
(291, 13, 9, 'Day in Court', 'In order to clear his name, a petty officer volunteers to be court martialed if NCIS agrees to conduct its own investigation after his murder case is dismissed due to a mishandled warrant. Also, Bishop and Jake discuss their marital problems.', 'https://image.tmdb.org/t/p/original/3teMktg1TjAgVztsxNw9vlM0TRJ.jpg'),
(292, 13, 10, 'Blood Brothers', 'The Secretary of Defense calls on NCIS to help a sailor who is battling leukemia to locate a donor for a bone marrow transplant, after two of his siblings are killed in the line of duty.  Meanwhile, Bishop returns home to Oklahoma for Thanksgiving.', 'https://image.tmdb.org/t/p/original/gHN2mRym1pL56h1KnbrSvx8vsER.jpg'),
(293, 13, 11, 'Spinning Wheel', 'After Ducky is attacked by a man claiming to have information about his half-brother who died decades ago, the NCIS team searches for the perpetrator, as Ducky recalls the final emotional days he had with his sibling.  Also, with the holidays approaching, Bishop and Jake discuss the future of their relationship.', 'https://image.tmdb.org/t/p/original/y6rEHwZVVum8l7G3jeKeB0UxR8n.jpg'),
(294, 13, 12, 'Sister City (I)', 'The passengers and crew of a private plane traveling from New Orleans to Washington, D.C., are poisoned and the evidence points to Abby\'s brother, the aircraft\'s missing chef.\n\nThe episode continues on NCIS: New Orleans S2E12 Sister City (II).', 'https://image.tmdb.org/t/p/original/fAphMArj4OdVKQyr2MFQC8pjTkR.jpg'),
(295, 13, 13, 'Déjà Vu', 'While investigating the murder of a seaman who was set to testify before a grand jury, the NCIS team uncovers the resurgence of an international human-trafficking ring.  Also, McGee hopes to spend the night at a colleague’s home after a storm causes massive power outages in the city.', 'https://image.tmdb.org/t/p/original/lIZAp08RaZTA23Zla9cIqFjDQt8.jpg'),
(296, 13, 14, 'Decompressed', 'Four deep sea divers stay inside a diving chamber with a deceased body in order to decompress. The dead body belongs to a retired petty officer who died in mysterious circumstances. The NCIS team will try to crack the case from land while the divers spend four days with the body.', 'https://image.tmdb.org/t/p/original/ajc7O9K4yTJ0cepxJnKM7lN6lMw.jpg'),
(297, 13, 15, 'React', 'When Secretary of the Navy Sarah Porter learns her daughter has been kidnapped, the NCIS team partners with the FBI to track the case, determine a motive and bring her home. Also, McGee’s childhood friend, NCIS Special Agent Valerie Page is in town to assist the team with advance tactics training', 'https://image.tmdb.org/t/p/original/rNIo1JfupDc032tGLTjhN8MFwZS.jpg'),
(298, 13, 16, 'Loose Cannons', 'Doctor Cyril Taft experiences the rush of an NCIS case after he is assigned surgical duty to Gibb’s suspect and finds key evidence. Also, Dinozzo pays Jeanne Benoit a visit as he chases a lead involving doctors in Sudan.', 'https://image.tmdb.org/t/p/original/4EQk4vDcGVkwrrkATVGcRg2R1cl.jpg'),
(299, 13, 17, 'After Hours', 'The NCIS agents’ personal plans are interrupted when each of them catches errors in a seemingly cut-and-dried closed case. Also, McGee and Delilah argue over the importance of not discussing work during dinner, while DiNozzo bores his date with shop talk.', 'https://image.tmdb.org/t/p/original/o1rDtum2F6JzZaYGfSeiCY4I7oM.jpg'),
(300, 13, 18, 'Scope', 'The NCIS team re-examines an ambush on a group of Special Ops snipers in Iraq after an American couple is attacked in the same area six months later. When Gibbs discovers he needs the account of the lone survivor, Marine Gunnery Sergeant Aaron Davis, he tries to connect with the wounded warrior who is being treated for PTSD at Walter Reed Medical Center.', 'https://image.tmdb.org/t/p/original/vVAJzB87Jul5YZcyq1qeDV7viYI.jpg'),
(301, 13, 19, 'Reasonable Doubts', 'A Navy Public Affairs officer is murdered, and the victim\'s wife and mistress accuse each other of the crime. Meanwhile, Anthony DiNozzo Sr. helps a homeless woman who believes he is her father.', 'https://image.tmdb.org/t/p/original/jOqtslt9LkKA0iLjcOUdCAziZ7X.jpg'),
(302, 13, 20, 'Charade', 'Tony\'s identity is stolen by multiple perpetrators who go on to blackmail politicians.', 'https://image.tmdb.org/t/p/original/6o1N2wJYv89YSYtnzVOjJ0fZahs.jpg'),
(303, 13, 21, 'Return to Sender', 'Gibbs and Senior FBI Agent T.C. Fornell unite after two British prisoners, including a former spy, escape and arrive stateside via a shipping container. Also, McGee is busy apartment hunting and determined to find out how DiNozzo purchased his lavish place.', 'https://image.tmdb.org/t/p/original/7kWYd2QChCT5pjNIJRpW38DLKWk.jpg'),
(304, 13, 22, 'Homefront', 'When a 14-year-old foils a home invasion, Gibbs suspects the teenager is withholding pertinent details. Also, Director Vance and Senior FBI Agent Fornell travel to London as part of the ongoing escaped British spy case.', 'https://image.tmdb.org/t/p/original/waYRubfNb8BUlziEcQ3rE4baFQ.jpg');
INSERT INTO `ex_episodes` (`epid`, `epseason`, `epnum`, `eptitle`, `epintro`, `epimg`) VALUES
(305, 13, 23, 'Dead Letter', 'The NCIS team, alongside the FBI and MI6, continue an international manhunt for an escaped British spy who has left one colleague fighting for their life in ICU.', 'https://image.tmdb.org/t/p/original/3x8eTGNbqqxyWGzs1mnFL0NXJOx.jpg'),
(306, 13, 24, 'Family First', 'NCIS, FBI and MI6 continue an international manhunt for an escaped British spy who is targeting current and former agents.', 'https://image.tmdb.org/t/p/original/jlmS4o9ulmmWtswQVMrZchM3xfo.jpg'),
(307, 14, 1, 'Rogue', 'The NCIS team investigates a deadly car explosion in D.C. that connects to NCIS Special Agent Nicholas “Nick” Torres, who disappeared six months ago while on a deep undercover assignment in Argentina. Also, Gibbs asks NCIS Special Agent Alexandra “Alex” Quinn to shadow his team after rejecting eight agents she instructed and referred for the open position.', 'https://image.tmdb.org/t/p/original/x6oHXYIJWyGbTq2mjcTdnmNOcxo.jpg'),
(308, 14, 2, 'Being Bad', 'NCIS uncovers a bomb plot and a long-running theft ring while investigating a death at a Quantico reunion. Also Torres and Quinn adjust to life on Gibbs’ team, including new seating arrangements in the squad room.', 'https://image.tmdb.org/t/p/original/6gsssI6cxfbLxCIUKUtBSqSUrlW.jpg'),
(309, 14, 3, 'Privileged Information', 'When the NCIS team investigates a marine sergeant’s tragic fall from a building, her doctor, Grace Confalone, confides in Gibbs and suggests he treat it as a murder investigation. Also, Torres searches for a place to live.', 'https://image.tmdb.org/t/p/original/1P5vGXq7ON0nJyzi1XsvOna9HIu.jpg'),
(310, 14, 4, 'Love Boat', 'After the body of a navy lieutenant is discovered aboard a destroyer during a tiger cruise, when civilian guests are allowed to spend the night on the ship, Gibbs, Quinn and Palmer travel out to sea to investigate. Also, McGee contemplates the perfect proposal for Delilah Fielding.', 'https://image.tmdb.org/t/p/original/n1E1LcadNZ3j2qDVa3J8Zjwf0g5.jpg'),
(311, 14, 5, 'Philly', 'When a missing MI6 Officer is linked to a murdered petty officer, Gibbs sends Quinn and Bishop to Philadelphia to work with MI6 Officer Clayton Reeves. Also, Quinn painfully recounts the NCIS case that made her leave field work.', 'https://image.tmdb.org/t/p/original/uqryu7kHVw6XdDVzx5d7t261Csp.jpg'),
(312, 14, 6, 'Shell Game', 'After a kidnapped petty officer escapes her captor, NCIS uncovers a connection to her missing husband. Also, Abby knits the NCIS newbies personalized gifts.', 'https://image.tmdb.org/t/p/original/fCW5LAcuTRlhazDazfdoydsvvPZ.jpg'),
(313, 14, 7, 'Home of the Brave', 'Torres boldly breaks protocol when he learns a witness in an NCIS case is wanted by U.S. Immigration and Customs Enforcement. Also, Abby, Bishop and McGee woo landlord Tony DiNozzo Sr. in the hope of subletting Tony’s apartment.', 'https://image.tmdb.org/t/p/original/ztqEgEHHQCv1zS6zj7nqjJ9M83g.jpg'),
(314, 14, 8, 'Enemy Combatant', 'After NCIS Agent Bishop is sent to Gitmo to gather evidence for a Navy chaplain murder case, she questions her previous work at the NSA. Also, Bishop’s brothers, John and Robert, visit for the Thanksgiving holiday and pester her co-workers to find out who she is dating.', 'https://image.tmdb.org/t/p/original/cT7RxGdvYkoF7t772qH1GlF9NQW.jpg'),
(315, 14, 9, 'Pay to Play', 'The NCIS team investigates a series of escalating threats against congresswoman Jenna Flemming,  while Director Vance oversees her temporary protection detail.', 'https://image.tmdb.org/t/p/original/lekPqr9BPGcBYhQ5G8EBPkxDhWJ.jpg'),
(316, 14, 10, 'The Tie That Binds', 'After the NCIS team tracks evidence from the murder of a Navy captain to Ducky’s deceased mother, Ducky looks back and questions a pivotal life choice he made 37 years ago. Also, the team exchanges holiday gifts, and Gibbs spends Christmas dinner with Fornell.', 'https://image.tmdb.org/t/p/original/s4cR0tB3U9kTY0Xz8u1G00XqQH5.jpg'),
(317, 14, 11, 'Willoughby', 'NCIS searches for new leads after an undercover operation to apprehend a businessman who uses acts of terror to manipulate the stock market is compromised. Also, Bishop and Qasim find a break in the case together.', 'https://image.tmdb.org/t/p/original/pMsfwiS38OoGaG9lskyVbeBFurz.jpg'),
(318, 14, 12, 'Off the Grid', 'When Gibbs spots the brother of an \"NCIS Most Wanted\" suspect, he takes the opportunity to assume his former alias and go undercover with their infamous anti-government militia. This leaves the NCIS team to piece together where and what Gibbs is up to. Meanwhile, Bishop and Reeves partner up on an off-the-books investigation.', 'https://image.tmdb.org/t/p/original/8aNhqb92Jhi8edichieJaiusluC.jpg'),
(319, 14, 13, 'Keep Going', 'During an NCIS hit-and-run investigation, Palmer joins a stranger on the outside ledge of a building in an attempt to save his life.', 'https://image.tmdb.org/t/p/original/e2UZUre18T94XJUr4GgzO17dNID.jpg'),
(320, 14, 14, 'Nonstop', 'The murder of a Petty Officer in a small town outside D.C. prompts NCIS to once again work with \"The Sherlocks,\" a privately funded investigative team that includes their newest member, Anthony DiNozzo, Sr.', 'https://image.tmdb.org/t/p/original/qQ9O7OGFKv1cgdT1o1sf3ygTlEB.jpg'),
(321, 14, 15, 'Pandora\'s Box (I)', 'After Abby\'s homeland security think tank is compromised and she is found in possession of a real bomb, the NCIS team discovers the leader of the group has been murdered and a theoretical terror playbook has been stolen.\n\nThe crossover continues on NCIS: New Orleans S03E14 Pandora\'s Box (II).', 'https://image.tmdb.org/t/p/original/cXXkn2Zdo8hsHEBpNEEacybvckL.jpg'),
(322, 14, 16, 'A Many Splendored Thing', 'Bishop is more determined than ever to seek revenge for the murder of Qasim, her late boyfriend, after Gibbs and the team find a new lead in the Chen case. Also, Torres teaches the agents the art of pickpocketing.', 'https://image.tmdb.org/t/p/original/sppsgPa5jHFoqvYFK8Lhdk4a1HE.jpg'),
(323, 14, 17, 'What Lies Above', 'McGee discovers his apartment has been torn apart by a robber trying to locate an item of great value hidden somewhere by the convicted criminal who previously owned the unit. Also, Congresswoman Flemming (Mary Stuart Masterson) tries to persuade Director Vance to pursue a career in politics.', 'https://image.tmdb.org/t/p/original/fmK5YuTEaCnpfNkqIGuq2q49BvC.jpg'),
(324, 14, 18, 'M.I.A.', 'To carry out a sailor\'s dying wish, Gibbs and the NCIS team reinvestigate a murder case that was originally ruled an accidental death. Also, the case reminds Torres of a tragic time from his past.', 'https://image.tmdb.org/t/p/original/pUXe4jQdzCIcHDKLfhzW3utNDrc.jpg'),
(325, 14, 19, 'The Wall', 'The team must rely on an irritable Vietnam War veteran to solve a Marine\'s murder.', 'https://image.tmdb.org/t/p/original/aLR8LPI09gVLMiEncH8WZ4oZMxW.jpg'),
(326, 14, 20, 'A Bowl of Cherries', 'A vice admiral tasks McGee with tracking down the hackers who infected his laptop with ransomware before the virus wipes out all his data. The cyberterrorism escalates when the virus spreads to the whole NCIS office. Quinn\'s family secret is revealed.', 'https://image.tmdb.org/t/p/original/1vS0NYHpekPLvcoTzHaOjZhGGnt.jpg'),
(327, 14, 21, 'One Book, Two Covers', 'A Marine\'s murder has connections to a dirt bike gang that Torres joined while on an old undercover operation.', 'https://image.tmdb.org/t/p/original/xm1xeEtd9KVpF2JQpQKQlZi7kwP.jpg'),
(328, 14, 22, 'Beastmaster', 'A gunnery sergeant\'s murder in a national park lead the team to join forces with the mounted police. While investigating the clues, they uncover a disturbing smuggling ring.', 'https://image.tmdb.org/t/p/original/gUeTz15Y6FbEUaBLBTb1R6thDbI.jpg'),
(329, 14, 23, 'Something Blue', 'The team suspects foul play when a healthy, young petty officer mysteriously dies in his sleep aboard a Navy destroyer. Wedding stress reaches its peak for McGee and his fiancée.', 'https://image.tmdb.org/t/p/original/p30PD2B0aXGmitpabjpGOffOH2S.jpg'),
(330, 14, 24, 'Rendezvous', 'When a Navy SEAL vanishes during  an unsanctioned trip, Gibbs, McGee and Torres travel to an unpopulated area in Paraguay that\'s teeming with violent rebels.', 'https://image.tmdb.org/t/p/original/6k3NEb94IrihOpZLQeOGgUheM5z.jpg'),
(331, 15, 1, 'House Divided', 'Season 15 begins with the NCIS team tirelessly searching for Gibbs and McGee two months after they were last seen fighting an elusive group of rebels in a Paraguay jungle. Meanwhile, Vance and Torres are summoned to a congressional hearing regarding the fallout from the Paraguay mission.', 'https://image.tmdb.org/t/p/original/910LwyOMd7sfnEkMHwlVYyqGpN0.jpg'),
(332, 15, 2, 'Twofer', 'NCIS investigates when the body of a murdered Navy lieutenant, who disappeared over a year ago, is found by a cemetery grounds crew while relocating caskets on the property. Meanwhile, Gibbs and McGee must pass a psych evaluation before they can officially resume working.', 'https://image.tmdb.org/t/p/original/oI0OZ1mCtzz94Dk70L2ffzpufZU.jpg'),
(333, 15, 3, 'Exit Strategy', 'Torres\' partner mysteriously vanishes during a stakeout with Metro P.D. The investigation uncovers new evidence from a decade-old murder case. Meanwhile, Ducky\'s friend, Cadence Darwin, presents him with a new opportunity during his guest lecture series.', 'https://image.tmdb.org/t/p/original/9jQipW2Rgg3xjkMe5X9UQa6JqPN.jpg'),
(334, 15, 4, 'Skeleton Crew', 'NCIS Special Agent Jacqueline Sloane, a forensic psychologist, joins the team just as a horrific storm shuts down Washington, D.C. During the power outage, a sailor is kidnapped, and Torres and Bishop go out to sea to track evidence.', 'https://image.tmdb.org/t/p/original/rQcEq63U8qm21dLybSGm5HBdFuW.jpg'),
(335, 15, 5, 'Fake It ‘Till You Make It', 'Reeves sees his friend get kidnapped and the investigation reveals the primary suspect disappeared two days earlier with confidential military information. Meanwhile, an embarrassing photo from McGee’s teen years becomes a popular meme.', 'https://image.tmdb.org/t/p/original/1lZzAOj1vomEhMlbHoNoNopZZfh.jpg'),
(336, 15, 6, 'Trapped', 'A petty officer is found murdered on a golf course, and McGee spends hours on the victim’s ham radio trying to locate a key witness. Meanwhile, Palmer asks his co-workers to donate to a charity that builds playgrounds for kids of all abilities, and Torres surprises them with his generosity.', 'https://image.tmdb.org/t/p/original/80S9iXwK8F53LdkGpbMD10klze.jpg'),
(337, 15, 7, 'Burden of Proof', 'A convicted felon claims NCIS framed him for murder a decade ago, so Gibbs investigates and asks Ducky to conduct a new autopsy. Meanwhile, Senior FBI agent Fornell joins the probe, since he was the lead investigator in the original joint FBI and NCIS case.', 'https://image.tmdb.org/t/p/original/gk02unpodzNaUjWWnk5M7pH8ChB.jpg'),
(338, 15, 8, 'Voices', 'An NCIS person of interest in a bribery and fraud case is found murdered after a runner is led to his body by a strange voice. Also, McGee and Delilah disagree on whether to find out the baby’s sex or keep it a surprise.', 'https://image.tmdb.org/t/p/original/2Dd7iuesmYj1xJEb84ph8MFWP47.jpg'),
(339, 15, 9, 'Ready or Not', 'The team tracks an elusive international arms dealer who recently murdered an MI6 officer; Abby races Delilah to the hospital when her labor starts three weeks early.', 'https://image.tmdb.org/t/p/original/jeRulwIhlijg1TlsspeqvuNCu69.jpg'),
(340, 15, 10, 'Double Down', 'As Torres and Sloane run protection detail for U.S. Senator John Phillips in Afghanistan for the holidays, they must urgently return to the states after hearing the senator’s son is in the ICU. Also, Gibbs and the team investigate the altercation that caused the life threatening injuries to the senator’s son.', 'https://image.tmdb.org/t/p/original/m2fRYlz4Ttsf4vb8rHGsikffliA.jpg'),
(341, 15, 11, 'High Tide', 'Torres and Bishop go undercover as a criminal couple available for hire, during an NCIS sting operation tracking illegal drug-running out of the Norfolk civilian marina.', 'https://image.tmdb.org/t/p/original/4rOHgKH1GuLGOeWEF03NZlPllok.jpg'),
(342, 15, 12, 'Dark Secrets', 'After a seemingly happy and successful Navy lieutenant appears to have taken her own life, Gibbs and the team conduct a thorough investigation, interviewing family and friends from her past and present.', 'https://image.tmdb.org/t/p/original/mkNP105pRXrjJnBKVXS0cdUt1KE.jpg'),
(343, 15, 13, 'Family Ties', 'After McGee and Torres visit the home of a high schooler who witnessed a hit-and-run, her parents, Christopher and Julie Bell, flee with their daughter, leaving NCIS in the lurch. Also, Vance’s daughter is arrested for shoplifting.', 'https://image.tmdb.org/t/p/original/3z9cOOuJvxVEs1E9eu4rT2wHEsV.jpg'),
(344, 15, 14, 'Keep Your Friends Close', 'After the body of a missing Navy commander is found, Vance orders Gibbs and the team to work with former FBI Agent Tobias \"T.C.\" Fornell, the private investigator who was hired to locate him. Also, Bishop and Torres interview convicted investment advisor Albert Hathaway when the victim is linked to his highly publicized trial.', 'https://image.tmdb.org/t/p/original/qzyCE0EMorZ2WmVtvCXGgRTrlOJ.jpg'),
(345, 15, 15, 'Keep Your Enemies Closer', 'NCIS strikes a deal with convicted murderer Paul Triff, giving him a 48-hour furlough at his former residence, now McGee\'s home, in exchange for information that can convict his former cellmate, Gabriel Hicks, the murderer who deceived Gibbs and Fornell.', 'https://image.tmdb.org/t/p/original/wSe8pVZjiq3cVxQs7fX5GUDov0S.jpg'),
(346, 15, 16, 'Handle with Care', 'Gibbs and the team work to clear the name of retired Marine Sergeant John Ross when cyanide is found in one of the hundreds of care packages he sends to active-duty Marines.', 'https://image.tmdb.org/t/p/original/8XvpdgFIgXWpdrBEZwWCDw8SQ1o.jpg'),
(347, 15, 17, 'One Man\'s Trash', 'Gibbs and Ducky are watching TV when they see the host handling a 200-year-old war stick that could be a match from a decade-old cold case.', 'https://image.tmdb.org/t/p/original/5VV9diNZ0eaoAe0Jgzoab0HcNG4.jpg'),
(348, 15, 18, 'Death from Above', 'The NCIS headquarters are evacuated after the team discovers a body as well as bomb materials on the roof of the squad room. Also, the team reads the first draft of Ducky’s book.', 'https://image.tmdb.org/t/p/original/uENMgscW87NejwZ9xMk9eUseCNJ.jpg'),
(349, 15, 19, 'The Numerical Limit', 'Gibbs is granted protective custody of a 10-year-old orphaned refugee, Elena, when an NCIS case reveals she is the target of a violent gang.', 'https://image.tmdb.org/t/p/original/8whkVGxLQsjY8ky5OqtHPPauSUi.jpg'),
(350, 15, 20, 'Sight Unseen', 'NCIS searches for a petty officer suspected of assault who escapes when the sheriff transporting him crashes into a lake. Also, Torres works closely with Annie Barth, a key blind witness who heard vital evidence needed to solve the case.', 'https://image.tmdb.org/t/p/original/vhbDQIg9y2DKWd11YmDF682wqSj.jpg'),
(351, 15, 21, 'One Step Forward', 'Sara Carter begs Gibbs to investigate her mother\'s murder; she believes the wrong man was convicted; Abby is awarded a dinner reservation for two to a new five-star restaurant in an igloo and has to decide which co-worker deserves to go with her.', 'https://image.tmdb.org/t/p/original/mwpxCBIF4b8Sx8iM4mH1RazNxO.jpg'),
(352, 15, 22, 'Two Steps Back', 'When evidence reveals an NCIS team member is a hitman’s latest target, the team must search through old case files to determine who is seeking vengeance.', 'https://image.tmdb.org/t/p/original/gQ5BSNQj0VX2BGWK0DiGvjJWn9B.jpg'),
(353, 15, 23, 'Fallout', 'While Gibbs attends the memorial service for a friend who was lost at sea, he discovers that the deceased, Navy Captain Phillip Brooks, has been hiding in a fallout shelter after his boat was attacked and he swam to shore.', 'https://image.tmdb.org/t/p/original/id1OXfnmUjifcgX1CFpynbSKSBs.jpg'),
(354, 15, 24, 'Date with Destiny', 'Sloane is adamant that a man who held her hostage and tortured her years ago in Afghanistan, and was believed to have been killed following her rescue, is alive and in D.C. Also, Vance and Gibbs fear Sloane is willing to risk everything to destroy this man.', 'https://image.tmdb.org/t/p/original/qvPY2q1LttmbuuVfHtio8h7G4d2.jpg'),
(355, 16, 1, 'Destiny\'s Child', 'One month after Director Vance was kidnapped, Gibbs is assigned the role of acting director in his absence while the team searches worldwide for his whereabouts.', 'https://image.tmdb.org/t/p/original/2OfDpRIiBnfdw1di5HU6Oj1hZMb.jpg'),
(356, 16, 2, 'Love Thy Neighbor', 'After a Navy lieutenant is found murdered in his hot tub, the team interviews several families in the victim’s peculiar neighborhood. Also, Torres must face the consequences after a volatile night out with Palmer.', 'https://image.tmdb.org/t/p/original/f4MTZ2trgLw5bsMMX41kyfNrbld.jpg'),
(357, 16, 3, 'Boom', 'One of the NCIS agents is starstruck after the team investigates an explosion outside the home of Navy Petty Officer First Class Todd Nicholas and his wife, popular reality TV star Sheba Nicholas. Also, Vance continues physical therapy for the injuries sustained when he was held hostage.', 'https://image.tmdb.org/t/p/original/6AUppQ0BulJHDskuLmoTAmuto2.jpg'),
(358, 16, 4, 'Third Wheel', 'Gibbs’ quiet vacation at his remote cabin is interrupted by a surprise visit from Tobias Fornell and Navy Captain Phillip Brooks, as well as a call from NCIS asking for his help locating a robber hiding in the woods near him.', 'https://image.tmdb.org/t/p/original/wuRr5jZNnceoXihlYGFAZCFq9l4.jpg'),
(359, 16, 5, 'Fragments', 'After a 50-year-old tape recording left by a murder victim is found, the NCIS team tries to exonerate Ray Jennings, the Marine serving a life sentence for the crime.', 'https://image.tmdb.org/t/p/original/dI7T9wOJCRb04tiw25CKLc7Y0NK.jpg'),
(360, 16, 6, 'Beneath the Surface', 'After NCIS arrives at a Halloween crime scene, Torres recognizes the victim as a friend from federal law enforcement training. Also, Jimmy thinks his lab is haunted by ghosts after objects keep mysteriously moving.', 'https://image.tmdb.org/t/p/original/aSCLTMw6D3Uz6miEkrmDEAySOkA.jpg'),
(361, 16, 7, 'A Thousand Words', 'After a mural by a street artist and activist is stolen, the NCIS investigation leads to a conspiracy regarding a Navy contractor and the safety of ocean mammals. Also, Bishop shares a special connection with the street artist.', 'https://image.tmdb.org/t/p/original/oKCd4Ln79jIRHFgFjf1isDM2aqk.jpg'),
(362, 16, 8, 'Friendly Fire', 'McGee and Bishop travel to Afghanistan after a murder case in the states is linked to a string of soldiers killed by friendly fire overseas. Also, Kasie leaves the lab and accompanies Torres into the field to process additional forensic evidence.', 'https://image.tmdb.org/t/p/original/fZjPCMqaXqvh9zWWbqZzULsXc1p.jpg'),
(363, 16, 9, 'Tailing Angie', 'When the lead suspect of an unsolved and high-profile robbery case is released from prison, the NCIS team resumes their investigation with an undercover stakeout.', 'https://image.tmdb.org/t/p/original/aR0wVb6s5Umy1ivoWcimEye3fMx.jpg'),
(364, 16, 10, 'What Child is This?', 'The team’s holiday plans are put on hold when the murder investigation of a Navy veteran includes the discovery of a newborn baby who has no identification and no apparent ties to a family.', 'https://image.tmdb.org/t/p/original/A1zCUimRihp6k6eqwazwwKReuQg.jpg'),
(365, 16, 11, 'Toil and Trouble', 'United States Secretary of Defense Wynn Crawford shuts down Gibbs\' murder investigation and demands that Special Agents McGee and Torres be arrested for their actions in the case.', 'https://image.tmdb.org/t/p/original/srgdNBJQ6zi81FWHQGNbf1y7KiU.jpg'),
(366, 16, 12, 'The Last Link', 'An old family friend, Army Corporal John Sydney, beseeches Gibbs to join him on a road trip to search for a missing military I.D. bracelet. Also, a Navy Lieutenant in NCIS protective custody is poisoned by an infamous drug dealer.', 'https://image.tmdb.org/t/p/original/a6gj6BLyX3XFsxFWHc2ntOHmFXc.jpg'),
(367, 16, 13, 'She', 'After a malnourished and confused 9-year-old is found hiding in a storage unit, NCIS reopens an old missing persons case when the girl is believed to be the daughter of a Navy recruit who disappeared 10 years ago. Also, Bishop discovers notes that Special Agent Ziva David kept on the case long after NCIS officially stopped investigating.', 'https://image.tmdb.org/t/p/original/3ti2pUacaNKaIAh8elHGQbhOg6Q.jpg'),
(368, 16, 14, 'Once Upon a Tim', 'McGee reluctantly visits his high school after the unique computer password he used as a teenager is linked to the murder of a department of defense contractor. The case escalates when an intruder breaks into McGee’s home in an attempt to steal his archaic high school computer.', 'https://image.tmdb.org/t/p/original/xL2lFCkXkZOhYfzXb2bdXHWKeVN.jpg'),
(369, 16, 15, 'Crossing the Line', 'The NCIS team investigates a man overboard fatality from a Navy destroyer at sea. Also, Torres is frustrated with Vance’s assignment to mentor three high school students.', 'https://image.tmdb.org/t/p/original/kRFyeJgk3Z2PuShwYAzOBPjSoYu.jpg'),
(370, 16, 16, 'Bears and Cubs', 'Jimmy is torn between family and work after his father-in-law, Ed, asks him to tamper with evidence from NCIS’ current murder investigation. Also, Ed’s poker buddy, Anthony DiNozzo, Sr., offers to help with the case.', 'https://image.tmdb.org/t/p/original/pUFa9SjeOz7L0Z0Hq7yRfZYZvC0.jpg'),
(371, 16, 17, 'Silent Service', 'Director Vance is notified by the Pentagon that the nuclear submarine Gibbs and Bishop are aboard to conduct a murder investigation has gone radio silent.', 'https://image.tmdb.org/t/p/original/q8p3S87V7sU52UzNAmZHfvLfZdh.jpg'),
(372, 16, 18, 'Mona Lisa', 'Torres relies on his team\'s investigative skills after he wakes up on a dilapidated fishing boat and is covered in blood and unable to remember the last 12 hours.', 'https://image.tmdb.org/t/p/original/fyGzAfiKnfdfjwx9xP9RUh3uK4s.jpg'),
(373, 16, 19, 'Perennial', 'Following an active shooter lockdown at a naval hospital, the team searches for a suspect who fled the scene; someone from Sloane\'s past is a key witness in the case.', 'https://image.tmdb.org/t/p/original/bCbR6obSUtXAED7w26wEInkrATs.jpg'),
(374, 16, 20, 'Hail & Farewell', 'NCIS investigates the murder of a Marine Major believed to have been killed in the 9/11 attack on the Pentagon after human remains are discovered at a construction site. A personal history with the victim drives Gibbs to solve her crime.', 'https://image.tmdb.org/t/p/original/xoRKUGGs9LSxPHQdpgg2xJoOUGg.jpg'),
(375, 16, 21, 'Judge, Jury...', 'After entering cold case DNA into the system, Kasie solves a 30-year-old murder case, but a loophole in the legal system may set the suspect free. Also, McGee visits an elite technology company in Silicon Valley that is offering him a highly paid position.', 'https://image.tmdb.org/t/p/original/dG8wUFXSJE19JY4rUE5g79trl7b.jpg'),
(376, 16, 22, '...and Executioner', 'After NCIS finds a secret government bank account that’s funding a nationwide network of vigilante justice, the team must determine who is acting as judge and jury.', 'https://image.tmdb.org/t/p/original/yPaZncGpJ1DaI6sYILLitpEiMUy.jpg'),
(377, 16, 23, 'Lost Time', 'The NCIS team investigates the murder of a Marine Sergeant in the States who was hailed as a war hero for his efforts overseas. Also, Gibbs turns to Doctor Grace Confalone for advice after he uncharacteristically unravels and abandons his team at a crime scene investigation.', 'https://image.tmdb.org/t/p/original/7T5uKguGiPf93SgldUTMT6IHJs.jpg'),
(378, 16, 24, 'Daughters', 'Former FBI Agent Tobias Fornell pleads with Gibbs to do whatever is necessary to take down drug dealers and suppliers in the area after his daughter, Emily Fornell, is hospitalized from an opiate overdose. Gibbs is haunted by the personal aspects of the case and his history with vigilante justice.', 'https://image.tmdb.org/t/p/original/wQte0P7YJSOVo6ZV0npCifbrZeN.jpg'),
(379, 17, 1, 'Out of the Darkness', 'Ziva surprises Gibbs with a cryptic warning, prompting him to question why she remained underground for years while being presumed dead by family and friends, and what led to her return.', 'https://image.tmdb.org/t/p/original/f6r2mDLxEcViD5PhraGMrqudmJ8.jpg'),
(380, 17, 2, 'Into the Light', 'With their lives in danger, Gibbs and Ziva’s rogue investigation takes an unexpected turn when a possible terrorist plot is revealed.', 'https://image.tmdb.org/t/p/original/kJWVRdYlBR36W2LGzqTxFuSbGAp.jpg'),
(381, 17, 3, 'Going Mobile', 'After the body of a Marine Lieutenant is found hidden under an 18-wheeler, the NCIS team tracks the vehicle’s previous locations to pinpoint the crime scene and suspect. Also, Sloane encourages the team to sit down and talk about Ziva’s recent reappearance.', 'https://image.tmdb.org/t/p/original/A9DIjmfR5KTYlNXa43TcIJ2HpmX.jpg'),
(382, 17, 4, 'Someone Else\'s Shoes', 'The NCIS team links a bizarre crime scene at Arlington National Cemetery to a string of attacks on homeless veterans. Also, Vance orders McGee, Bishop and Torres to complete hours of evidence garage cleanup duty for withholding information.', 'https://image.tmdb.org/t/p/original/4QBC9gxrNJ8QxgK9UAb3nJXjvF5.jpg'),
(383, 17, 5, 'Wide Awake', 'NCIS investigates Marine Corporal Laney Alimonte after evidence suggests she murdered her neighbor while being treated for insomnia by a hypnotherapist. Also, Gibbs befriends his new neighbors after the 9-year-old’s baseball crashes through his window.', 'https://image.tmdb.org/t/p/original/73AKlsPjjVSFvHoJG5rpXzesVQD.jpg'),
(384, 17, 6, 'Institutionalized', 'After a petty officer’s son is found murdered at his “welcome home from prison” party, evidence suggests Kasie’s lifelong best friend, Dante Brown, is the suspect.', 'https://image.tmdb.org/t/p/original/pybLwxo415qDekVrSNHwM64uI3N.jpg'),
(385, 17, 7, 'No Vacancy', 'While investigating a Marine’s murder, the NCIS team uncovers a labyrinth of live-streaming spy cameras hidden in the rooms of a Virginia motel.', 'https://image.tmdb.org/t/p/original/8IZFtkyaHHDbAfGpbRttrmzSDeo.jpg'),
(386, 17, 8, 'Musical Chairs', 'The NCIS team investigates the murder of a musician in the Navy’s most elite band that performs at diplomatic events around the world.', 'https://image.tmdb.org/t/p/original/eAXhMr6dfQziJpyde8tt5UO4jEd.jpg'),
(387, 17, 9, 'IRL', 'The NCIS team investigates a petty officer\'s murder that was livestreamed on a popular gaming app; Gibbs watches his 11-year-old neighbor when his mom must leave on a last-minute trip.', 'https://image.tmdb.org/t/p/original/pB8TDOJirnaq2eARSTnZ164s7AT.jpg'),
(388, 17, 10, 'The North Pole', 'Gibbs and the team help Ziva with the \"one thing\" she said she\'d take care of before returning to her family.', 'https://image.tmdb.org/t/p/original/dYUhjpSN2VVPdwhQWJ2QgKktffA.jpg'),
(389, 17, 11, 'In the Wind', 'Gibbs must face the consequences of helping Ziva with \"the one thing\" she said she\'d take care of before returning to her family.', 'https://image.tmdb.org/t/p/original/mPxECULZUpCFS32zHlMzSO6vYjp.jpg'),
(390, 17, 12, 'Flight Plan', 'The NCIS team investigates an F-18 crash and the subsequent disappearance of the pilot; McGee reluctantly discusses a very personal decision with his teammates.', 'https://image.tmdb.org/t/p/original/lLJZFGqfoM80T5R17L6f9qazgZq.jpg'),
(391, 17, 13, 'Sound Off', 'After a body is found at an unmanned aerial vehicle testing site, the NCIS team must determine if the death was murder or an accident. Also, Palmer carefully interviews medical examiner assistant candidates', 'https://image.tmdb.org/t/p/original/xeCA8AW3ACjev9TrYwzptpQNV0r.jpg'),
(392, 17, 14, 'On Fire', 'After Torres and Bishop are victims of a hit-and-run, Torres fights for his life in the Intensive Care Unit.', 'https://image.tmdb.org/t/p/original/Aw6fHV6IN4fdFp0CizDbWcpK0E.jpg'),
(393, 17, 15, 'Lonely Hearts', 'The lead suspect in an NCIS murder investigation is a woman Gibbs\' friend, Phillip Brooks, met on a dating site. Also, Sloane has a secret admirer on Valentine\'s Day.', 'https://image.tmdb.org/t/p/original/sUHEvFDuVDN2r5tM3j2Ij4FYIl2.jpg'),
(394, 17, 16, 'Ephemera', 'While investigating the suicide of a retired Navy officer who left a rare, valuable - and possibly stolen - coin to the National Museum of the Navy, the team imagines themselves in his life story in order to piece together how the coin ended up in his possession.', 'https://image.tmdb.org/t/p/original/z64FVrRzCEcu9ricK9d6In5InWA.jpg'),
(395, 17, 17, 'In a Nutshell', 'As the NCIS team investigates the death of a Navy officer murdered the same way as his parents a decade ago, they stumble across a storage container filled with dollhouses that display recreations of murder scenes. The team agrees to clean out their living spaces, but some have a harder time saying goodbye to their possessions than others.', 'https://image.tmdb.org/t/p/original/yqdche2k66WdXb7pBUyXMqjXYLL.jpg'),
(396, 17, 18, 'Schooled', 'The team searches for answers when the body of a well-regarded Navy technician in the Reserves is found floating in a lake where a popular community event is being held. Sloane is caught off-guard when her daughter makes an unexpected request.', 'https://image.tmdb.org/t/p/original/mSpsEE6vzUtIiC0itvSVGjmeeJ8.jpg'),
(397, 17, 19, 'Blarney', 'When Kasie and Jimmy are held hostage in a diner after a jewelry store robbery goes awry, they attempt to keep the other customers safe from the thieves.', 'https://image.tmdb.org/t/p/original/yqSlOm6hNOnm88dinpRCynL1c5Z.jpg'),
(398, 17, 20, 'The Arizona', 'The team tries to verify the identity of Joe Smith, who claims he served on the U.S.S. Arizona during the attack on Pearl Harbor, and wants to be buried there upon his death.', 'https://image.tmdb.org/t/p/original/gX56I2MOYijRIwhfMB4glPqcfoK.jpg'),
(399, 18, 1, 'Sturgeon Season', 'Gibbs and Fornell attempt to track down the leader of a drug ring who supplied drugs to Fornell\'s daughter. Also, the team deals with the case of a missing cadaver from the NCIS autopsy room.', 'https://image.tmdb.org/t/p/original/tThwJrv5oQ5Q4Qbj9WPV9EtR59C.jpg'),
(400, 18, 2, 'Everything Starts Somewhere', 'Flashbacks reveal the murder case that first introduced young Gibbs to NCIS and his introduction to young, new-to-America Ducky.', 'https://image.tmdb.org/t/p/original/orcQqdzFWQw6Nfdros7TsX44ojA.jpg'),
(401, 18, 3, 'Blood And Treasure', 'The discovery of two dead bodies in a forest leads the NCIS team into the wild world of modern-day treasure hunting. Also, Gibbs and Fornell get deeper into their search for the opioid kingpin.', 'https://image.tmdb.org/t/p/original/5QgIXFRmE7LW997e0YY2LXWn4Ez.jpg'),
(402, 18, 4, 'Sunburn', 'McGee and his wife Delilah\'s (Margo Harshman) Bahamian vacation turns into a high-stakes mission when a case NCIS is tracking of a dead escape room manager has ties to the island. Also, Gibbs fears the worst when his search for Fornell leads to blood.', 'https://image.tmdb.org/t/p/original/bGGvSEAzPa6IlsM6YtC8wteZ6zw.jpg'),
(403, 18, 5, 'Head of the Snake', 'Gibbs and Fornell\'s crusade to find the head of the drug ring responsible for Fornell\'s daughter Emily\'s overdose comes to a climax. Also, Gibbs and Vance finally let the team in on a case that has dangerous implications.', 'https://image.tmdb.org/t/p/original/5cUFaWfvjBjRvwoFFZDpoHU11SP.jpg'),
(404, 18, 6, '1mm', 'Following a tip about smuggled weapons, Bishop and Torres engage in a shootout in a former sheriff\'s residence that\'s now a historical site, only to find themselves locked in abandoned jail cells there.', 'https://image.tmdb.org/t/p/original/A0Rjvp7BSanT7hx1yh1Urgs9lAs.jpg'),
(405, 18, 7, 'The First Day', 'NCIS investigates the murder of a Navy officer who was killed while driving home a recently released inmate. Also, Gibbs helps Palmer deal with a personal trauma', 'https://image.tmdb.org/t/p/original/9FKJ64wMjo7alfbuwtwlAXU1zZM.jpg'),
(406, 18, 8, 'True Believer', 'When Sloane’s name is discovered in Afghanistan at the site of an abandoned bus with a dead driver, Gibbs accompanies her on a trip to find a group of girls who were kidnapped from the bus. McGee, Bishop and Torres track down a hacker who emailed compromising information to the Taliban.', 'https://image.tmdb.org/t/p/original/ecrds5ripoy4Fq8ugdIYmLVu3Nx.jpg'),
(407, 18, 9, 'Winter Chill', 'NCIS dives into the competitive world of food trucks after finding a man frozen to death in the back of one.', 'https://image.tmdb.org/t/p/original/kvZzkwynU8m1Ot9zQhV1VOPMJxn.jpg'),
(408, 18, 10, 'Watchdog', 'NCIS uncovers a secret dogfighting ring, which leads to an unexpected move by one of the team members.', 'https://image.tmdb.org/t/p/original/pJa5aLufNKU23KqFO0tNw5f7iz6.jpg'),
(409, 18, 11, 'Gut Punch', 'Vance assigns McGee, Torres, and Bishop to Covid compliance duty at a foreign affairs summit, where they discover a link to another NCIS team\'s murder case.', 'https://image.tmdb.org/t/p/original/g2oC7NM05DZjt5S72Js6MQw43W2.jpg'),
(410, 18, 12, 'Sangre', 'Evidence from the stabbing of a Marine Sergeant leads Torres to meet his father who left when he was a child', 'https://image.tmdb.org/t/p/original/egQUHdbQhghtcM6bceIwu3yKtCA.jpg'),
(411, 18, 13, 'Misconduct', 'The team investigates a biker killed in a hit and run. Gibbs prepares to testify against a financial advisor who stole millions from his Navy clients.', 'https://image.tmdb.org/t/p/original/f00ULeYDQK5l6OTmlhDFZp0eP2c.jpg'),
(412, 18, 14, 'Unseen Improvements', 'NCIS tracks a stolen laptop to the uncle of a young boy, Phineas, Gibbs’ former neighbor.', 'https://image.tmdb.org/t/p/original/43wytDdgC6fH8R5IHDcN9XCXJKh.jpg'),
(413, 18, 15, 'Blown Away', 'When members of an NCIS Regional Enforcement Action Capabilities Training Team (REACT) are killed during an explosion, NCIS Special Agent Jessica Knight (Katrina Law), the lone surviving member, helps crack the case using high tech body armor', 'https://image.tmdb.org/t/p/original/zodGiL6FErRhLjnlQ7TQUfUDObf.jpg'),
(414, 18, 16, 'Rule 91', 'While pursuing a dangerous arms dealer, the team is shocked when Bishop is implicated in an old NSA leak while Gibbs and Marcie realize the killer they\'ve been tracking may be onto them.', 'https://image.tmdb.org/t/p/original/AllX1J4IsSLdtEpP63SrPDRM4M6.jpg'),
(415, 19, 1, 'Blood in the Water', 'As the NCIS team searches for Gibbs after wreckage from his boat is discovered, they find out he was tracking a serial killer with journalist Marcie Warren, who wrote an exposé on him.', 'https://image.tmdb.org/t/p/original/mMobF6gFLTSj0XoVHam70imCt7w.jpg'),
(416, 19, 2, 'Nearly Departed', 'While trying to find the serial killer Gibbs was after, the NCIS team discovers another person has been tracking the case as well.', 'https://image.tmdb.org/t/p/original/txdEWLibheWMEb00P8pYoNch4gz.jpg'),
(417, 19, 3, 'Road to Nowhere', 'Gibbs and Parker go on a road trip to find one of the serial killer\'s victims. Also, Agent Knight goes undercover at a large manufacturing company with ties to the murders.', 'https://image.tmdb.org/t/p/original/wDw3VKbxW6qr5wSwhpnA7XA7dWc.jpg'),
(418, 19, 4, 'Great Wide Open', 'Gibbs and McGee head to Alaska while the team works at home to uncover the conspiracy behind the serial killer.', 'https://image.tmdb.org/t/p/original/eGWeW0ZChX43G0YSTtGik2jIcDi.jpg'),
(419, 19, 5, 'Face the Strange', 'The NCIS team investigates the death of a Navy commander whose body suddenly explodes before Jimmy can examine it.', 'https://image.tmdb.org/t/p/original/iWM780infuavHASgUW0SvZk8ptt.jpg'),
(420, 19, 6, 'False Start', 'NCIS investigates the death of a beloved Navy commander who trained some of the top athletes in the country.', 'https://image.tmdb.org/t/p/original/7dghCOKSalQXeZ1ljTMPX7HgA4Z.jpg'),
(421, 19, 7, 'Docked', 'NCIS investigates the death of a man on a cruise ship whose body is discovered in the ship\'s sauna by none other than McGee\'s mother-in-law, Judy.', 'https://image.tmdb.org/t/p/original/odILTsF052wJgdmRqOh8FOMwcj6.jpg'),
(422, 19, 8, 'Peacekeeper', 'NCIS investigates the case of a Navy reservist whose body is found in a beat-up car at the end of a gun range. Kasie weighs the pros and cons of buying a gun.', 'https://image.tmdb.org/t/p/original/k2LvucMkBeGsXUTSkSzT6Vs7BtH.jpg'),
(423, 19, 9, 'Collective Memory', 'When a hotshot financial advisor is found shot at a naval station, NCIS investigates the case by interviewing the victim’s three-dimensional hologram of herself, which she created before her death.', 'https://image.tmdb.org/t/p/original/pH3fkwOVX2Wvtj3j2LWVwoFR7T5.jpg'),
(424, 19, 10, 'Pledge of Allegiance', 'NCIS is called in when Navy Chief Warrant Officer Rafi Nazar is suspected of trying to sell stolen classified Navy software used to pilot combat drones.', 'https://image.tmdb.org/t/p/original/n22H93XEYuKmsWuIYu3OnEtP8uF.jpg'),
(425, 19, 11, 'All Hands', 'After a civilian research vessel in the North Atlantic picks up a small boat of wounded Navy officers, NCIS arrives on the ship and is forced to hide after discovering terrorists on board. Also, Agent Knight takes a paper doll with her on the mission to capture photos for her niece’s grade school class.', 'https://image.tmdb.org/t/p/original/jOQm30mvQhonTp82aINqrCBqEcT.jpg'),
(426, 19, 12, 'Fight or Flight', 'When the body of a Navy lieutenant is discovered missing an eye, the NCIS investigation leads to the world of cage fighting.', 'https://image.tmdb.org/t/p/original/zXsOvxGgoGdfPo1DLqpMVITxG1y.jpg'),
(427, 19, 13, 'The Helpers', 'While investigating the death of an intruder at Quantico, Jimmy and Kasie are exposed to a deadly biotoxin; the NCIS team calls on Dr. Carol Wilson for help as they race to find the antidote; Torres tries to distract Jimmy\'s daughter.', 'https://image.tmdb.org/t/p/original/kyPRHhGtUDj0cGSqZacbfeKB8Qm.jpg'),
(428, 19, 14, 'First Steps', 'As NCIS investigates the cause of death of a reservist Navy SEAL surgeon, they\'re forced to bring Vance\'s daughter to help with a highly dangerous mission.', 'https://image.tmdb.org/t/p/original/9RpMSoGHlAIVrX0ytdcVy1j1km1.jpg'),
(429, 19, 15, 'Thick As Thieves', 'Parker’s delinquent past resurfaces when NCIS is called to Philadelphia to investigate the death of a Navy petty officer.', 'https://image.tmdb.org/t/p/original/viiVQv0YezFpJo6SS9lEgcMGXTv.jpg'),
(430, 19, 16, 'The Wake', 'A gruesome mishap at a Navy petty officer’s gender-reveal party leads NCIS to the case of a missing teacher that was popularized on a true crime podcast.', 'https://image.tmdb.org/t/p/original/pAJcFnSrqRmU6ZAXLzyVZdrf4pf.jpg'),
(431, 19, 17, 'Starting Over (I)', 'NCIS investigates the apparent suicide of a retired Navy officer who was in Palmer and Knight\'s grief group; Torres gets a call from NCIS Special Agent Jane Tennant to come to Hawai\'i.\n\nThe crossover continues on NCIS: Hawai\'i S01E18 T\'N\'T (II).', 'https://image.tmdb.org/t/p/original/8defjzI1x3uzdORc6C2jnOboWgK.jpg'),
(432, 19, 18, 'Last Dance', 'When an infamous arms dealer, Reymundo Diaz, is released from prison and bodies start piling up, Torres is forced to face the repercussions of his actions during an undercover operation he worked on years ago.', 'https://image.tmdb.org/t/p/original'),
(433, 19, 19, 'The Brat Pack', 'NCIS investigates a ring of clever teenage partygoers when a string of break-ins takes place at Marine Base Quantico. While working the case, Special Agent McGee forms a bond with one of the teens, Teagan Fields.', 'https://image.tmdb.org/t/p/original'),
(434, 19, 20, 'All or Nothing', '', 'https://image.tmdb.org/t/p/original'),
(435, 19, 21, 'Birds of a Feather', 'When Agent Parker is framed for murder, the team puts their jobs and lives on the line to buy time and uncover the truth.', 'https://image.tmdb.org/t/p/original');
